INSERT INTO area_estrategica VALUES (1, 'Ambiente', 'Impulsar un modelo de desarrollo fundamentado en la sustentabilidad ecol√≥gica, cultural, social y pol√≠tica a trav√©s de la conservaci√≥n y uso sustentable de la naturaleza y un ordenamiento ambiental basado  en el respeto a la soberan√≠a y la diversidad biol√≥gica y cultural.');
INSERT INTO area_estrategica VALUES (2, 'Energ√≠a y Petr√≥leo', 'Identificar fuente de energ√≠a alternativa y desarrollar mecanismos eficientes de generaci√≥n, distribuci√≥n y uso sustentable de la energ√≠a, favoreciendo el equilibrio entre  la conservaci√≥n del ambiente, el desarrollo integral de las comunidades y las prioridades nacionales como potencia energ√©tica');
INSERT INTO area_estrategica VALUES (3, 'Telecomunicaciones', 'Mejorar los sistemas de telecomunicaciones y garantizar el acceso de toda la poblaci√≥n a los mismos, fortaleciendo la participaci√≥n popular, democr√°tica y protag√≥nica');
INSERT INTO area_estrategica VALUES (4, 'Pol√≠tica y Sociedad', 'Comprender los procesos sociales y pol√≠ticos en Venezuela y nuestram√©rica, con miras a empoderar a las comunidades en los procesos de transformaci√≥n de la sociedad venezolana y mejorar el dise√±o y la gesti√≥n de las pol√≠ticas p√∫blicas');
INSERT INTO area_estrategica VALUES (5, 'Educaci√≥n', 'Transformar el sistema educativo nacional para la generaci√≥n de ciudadanas y ciudadanos comprometidas y comprometidos con la comprensi√≥n cr√≠tica y la transformaci√≥n de la realidad individual, colectiva y nacional hacia la emancipaci√≥n');
INSERT INTO area_estrategica VALUES (6, 'Vivienda, H√°bitat y Desarrollo Urbano', 'Impulsar un desarrollo sostenible, donde las viviendas se inserten de manera org√°nica en un h√°bitat seguro, saludable, justo y equitativo');
INSERT INTO area_estrategica VALUES (7, 'Salud Colectiva', 'Garantizar la salud integral de la poblaci√≥n venezolana a trav√©s del mejoramiento de las condiciones de vida, los sistemas de prevenci√≥n de enfermedades y la asistencia m√©dica universal, fortaleciendo el Sistema P√∫blico Nacional de Salud');
INSERT INTO area_estrategica VALUES (8, 'Seguridad y Soberan√≠a Alimentaria', 'Garantizar el acceso estable y oportuno a los alimentos en la calidad y cantidad necesaria para satisfacer los requerimientos de toda la poblaci√≥n');
INSERT INTO area_estrategica VALUES (9, 'Miner√≠a, Metal√∫rgica y Materiales', 'Desarrollar un modelo sustentable que garantice la transformaci√≥n de las materias primas en productos semielaborados y elaborados a trav√©s de procesos industriales, para satisfacer los requerimientos de la industria transformadora a fin de lograr con el uso razonable y planificado de los recursos naturales la diversificaci√≥n industrial del pa√≠s y la transformaci√≥n de la sociedad');
INSERT INTO area_estrategica VALUES (10, 'Desarrollo Industrial', 'Garantizar el desarrollo de una plataforma industrial ambiental, social, cultural y pol√≠ticamente sustentable, que se constituya en una fuerza formadora y transformadora de la sociedad venezolana hacia la independencia, la equidad y la justicia, proveyendo a los venezolanos con herramientas necesarias para alcanzar la Suprema Felicidad Social perdurable');
INSERT INTO area_estrategica VALUES (11, 'Seguridad Ciudadana y Convivencia Solidaria', 'Garantizar el derecho a la seguridad ciudadana, la igualdad y no discriminaci√≥n, al h√°bitat y al disfrute de la ciudad como espacio colectivo de convivencia, as√≠ como la promoci√≥n de estrategias y mecanismos de control social para minimizar la conflictividad  y garantizar el derecho a la justicia requerida para satisfacer necesidades de la poblaci√≥n');
