INSERT INTO frases_chavez VALUES (1, 'Seguiremos batallando por la verdadera unidad e integraci√≥n de nuestros pueblos, pero no es con el imperialismo que vamos a integrarnos nosotros, ¬°no!, bastante da√±o le hizo el imperio norteamericano al proyecto de Bol√≠var.', 'Acto con motivo del III Aniversario de la Misi√≥n Barrio Adentro. Teatro Municipal de Caracas, 21 de abril de 2006.', 'img/chavez/001.png');
INSERT INTO frases_chavez VALUES (2, 'A quienes apuestan, desde hace 200 a√±os, cuando Bol√≠var convoc√≥ el Congreso Anficti√≥nico de Panam√°, a nuestra divisi√≥n, debemos enfrentarlos avanzando en la integraci√≥n, para insertarnos con posibilidad de √©xito en este mundo.', 'Rueda de Prensa. Encuentro cuatrilateral de los presidentes de Argentina, Bolivia, Brasil y Venezuela. Iguaz√∫, Argentina; 04 de mayo de 2006.', 'img/chavez/002.png');
INSERT INTO frases_chavez VALUES (3, 'El bolivarianismo recupera la conciencia de la gran naci√≥n, de la gran patria y, por tanto,de una integraci√≥n verdadera y profunda desde el alma de los pueblos.', 'Entrevista al Presidente Ch√°vez por el periodista Enzo Micalizzi, del Canal RAI-2 de Italia. 10 de mayo de 2006', 'img/chavez/003.png');
INSERT INTO frases_chavez VALUES (4, 'En Venezuela, la base fundamental de nuestro sistema de gobierno, de nuestro proyecto, no es otra hoy, 180 a√±os despu√©s, que el proyecto socialista venezolano, a trav√©s de la democracia revolucionaria y bolivariana que est√° en marcha por los cuatro rumbos de Venezuela.', 'Inauguraci√≥n de la Unidad Materno Infantil ‚ÄúDr. Oswaldo Ismael Brito. Tucupita, estado Delta Amacuro; 20 de mayo de 2006.', 'img/chavez/004.png');
INSERT INTO frases_chavez VALUES (13, 'Estamos llamados a conocer en profundidad nuestras civilizaciones abor√≠genes, aut√≥ctonas, nuestras ra√≠ces.', 'Al√≥ Presidente N¬∞ 256. Ciudad Sagrada de Tiwanaku, Bolivia; 28 de mayo de 2006.', 'img/chavez/013.png');
INSERT INTO frases_chavez VALUES (33, 'Es imposible que se piense en hacer una revoluci√≥n sin que la juventud se convierta en el motor fundamental, aportando su pureza, amor, fuerza y pasi√≥n.', 'Entrega de becas y relanzamiento de la Fundaci√≥n Gran Mariscal de Ayacucho.Teatro Teresa Carre√±o, 2 de mayo de 2006.', 'img/chavez/033.png');
INSERT INTO frases_chavez VALUES (34, 'El proceso revolucionario es como un r√≠o que va corriendo y enfrenta distintas situaciones que se van presentando, no es est√°tico. Si no, no ser√≠a una revoluci√≥n.', 'Primer Encuentro Nacional de Cajas Rurales 2006. Complejo de Eventos Bellas Artes, estado Lara.', 'img/chavez/034.png');
INSERT INTO frases_chavez VALUES (35, 'Lo que me quede de vida ser√° para d√°rsela √≠ntegra al pueblo que amo: ¬°Venezuela!', 'Inauguraci√≥n de la Fase I del Acueducto Chirgua-El Cercado. 5 de mayo de 2006.', 'img/chavez/035.png');
INSERT INTO frases_chavez VALUES (36, 'El d√≠a que termine de morir el viejo tiempo y termine de nacer el nuevo tiempo, yo me podr√© ir tranquilo a donde sea; pero mientras tanto, estar√© con ustedes al frente de esta batalla por la dignidad, la vida y el futuro de la Patria, enfrentando lo que haya que enfrentar.', 'II Gabinete M√≥vil Comunal. Barquisimeto, estado Lara; 06 de mayo de 2006.', 'img/chavez/036.png');
INSERT INTO frases_chavez VALUES (37, '¬°Educaci√≥n!, ¬°educaci√≥n!, ¬°educaci√≥n!: he all√≠ la base fundamental de la conciencia, del despertar y de la Revoluci√≥n.', 'Al√≥ Presidente N¬∞ 256. Ciudad Sagrada de Tiwanaku, Bolivia; 28 de mayo de 2006.', 'img/chavez/037.png');
