INSERT INTO frases_chavez VALUES (96, 'Debemos poner por delante la verdadera pol√≠tica, porque es la pol√≠tica la que debe regir el destino de los pueblos y orientar los proyectos de desarrollo nacionales.', 'Entrevista radial de ALER (Asociaci√≥n Latinoamericana de Educaci√≥n Radiof√≥nica) al presidente de la Rep√∫blica Bolivariana de Venezuela, Hugo Ch√°vez. Asunci√≥n, Paraguay; 19 de abril de 2006.', 'img/chavez/096.png');
INSERT INTO frases_chavez VALUES (97, 'Invito a los j√≥venes a que vayan apuntalando la Revoluci√≥n y sigan trabajando la ideolog√≠a, el proyecto nacional, y profundizando el trabajo que deben hacer.', 'Al√≥ Presidente N¬∞ 253. Campo Oficina, municipio Sim√≥n Rodr√≠guez, El Tigre, estado Anzo√°tegui; 23 de abril de 2006.', 'img/chavez/097.png');
INSERT INTO frases_chavez VALUES (98, 'Ning√∫n pa√≠s se desarrollar√° si no le da valor agregado a su materia prima.', 'Declaraciones del presidente Ch√°vez, Iguaz√∫, Argentina; 04 de mayo de 2006.', 'img/chavez/098.png');
INSERT INTO frases_chavez VALUES (100, 'El √∫nico camino por donde no fallaremos, ser√° por el camino de una genuina Revoluci√≥n.', 'Primer Encuentro Nacional de Cajas Rurales 2006. Complejo de Eventos Bellas Artes, estado Lara. 5 de mayo de 2006.', 'img/chavez/100.png');
INSERT INTO frases_chavez VALUES (130, 'Estamos llamando a construir el socialismo del siglo XXI, un socialismo fresco y nuevo, no dogm√°tico, flexible, impulsando la democracia participativa y la democracia protag√≥nica.', 'Reuni√≥n con empresarios del Reino Unido. Canning House, Londres; 15 de mayo de 2006.', 'img/chavez/130.png');
INSERT INTO frases_chavez VALUES (123, 'Para que el pueblo se concrete en fuerza real, debe tener, primero que nada, conciencia; y para que el pueblo tenga conciencia, debe tener conocimiento y cultura.', 'Al√≥ Presidente N¬∞ 252. Campo de Carabobo, 9 de abril de 2006.', 'img/chavez/123.png');
INSERT INTO frases_chavez VALUES (126, 'El capitalismo divide en pedazos: una √©lite minoritaria se enriqueci√≥ a trav√©s del modelo capitalista, y una gran mayor√≠a fue explotada, dominada y esclavizada.', 'Primer Encuentro Nacional de Cajas Rurales 2006. Complejo de Eventos Bellas Artes, estado Lara. 5 de mayo de 2006.', 'img/chavez/126.png');
INSERT INTO frases_chavez VALUES (146, 'El nuestro es un proyecto que se inscribe en la bandera de Sim√≥n Rodr√≠guez, donde la educaci√≥n es un derecho humano fundamental; el nuestro es un proyecto socialista que garantiza educaci√≥n gratuita y de calidad para todos.', 'Entrega de titularidad a docentes del estado Zulia. Plaza de Toros Monumental de Maracaibo, 10 de junio de 2006.', NULL);
INSERT INTO frases_chavez VALUES (127, 'Si el capitalismo sigue reinando en este planeta la vida se acabar√°, porque ya est√° rompiendo el equilibrio ecol√≥gico.', 'Inauguraci√≥n de la Fase I del Acueducto Chirgua-El Cercado. Estaci√≥n de Bombeo El Vidrio, estado Lara. 5 de mayo de 2006.', 'img/chavez/127.png');
INSERT INTO frases_chavez VALUES (128, 'Venezuela ha tomado la vanguardia mundial en la denuncia del imperialismo, fase superior del capitalismo, y en el impulso al socialismo.', 'Al√≥ Presidente N¬∞ 254. Barquisimeto, estado Lara; 7 de mayo de 2006.', 'img/chavez/128.png');
INSERT INTO frases_chavez VALUES (131, 'El proyecto bolivariano avanza con √©xito en lo social, en lo econ√≥mico y en lo pol√≠tico; un proyecto absolutamente democr√°tico, con relaciones productivas y positivas con el mundo entero.', 'Reuni√≥n con empresarios del Reino Unido. Canning House, Londres; 15 de mayo de 2006.', 'img/chavez/131.png');
INSERT INTO frases_chavez VALUES (134, 'En Venezuela, la base fundamental de nuestro sistema de gobierno, de nuestro proyecto, no es otra hoy, 180 a√±os despu√©s, que el proyecto socialista venezolano, a trav√©s de la democracia revolucionaria y bolivariana que est√° en marcha por los cuatro rumbo revolucionaria y bolivariana que est√° en marcha por los cuatro rumbos de Venezuela.', 'Inauguraci√≥n de la Unidad Materno Infantil ‚ÄúDr. Oswaldo Ismael Brito. Tucupita, estado Delta Amacuro; 20 de mayo de 2006.', 'img/chavez/134.png');
INSERT INTO frases_chavez VALUES (135, 'Estamos dando pasos firmes y bien orientados en el establecimiento y la pr√°ctica, el desarrollo, el ejercicio de una nueva econom√≠a din√°mica, diversificada, productiva y, adem√°s, humanista, que est√© al servicio de lo social.', 'Al√≥ Presidente N¬∫ 255. Ciudad Guayana, Estado Bol√≠var; 21de mayo de 2006.', 'img/chavez/135.png');
INSERT INTO frases_chavez VALUES (136, 'En el socialismo la econom√≠a est√° al servicio del ser humano y es un instrumento fundamental para generar igualdad.', 'Al√≥ Presidente N¬∫ 255. Ciudad Guayana, Estado Bol√≠var; 21de mayo de 2006.', 'img/chavez/136.png');
INSERT INTO frases_chavez VALUES (138, 'El socialismo se construye todos los d√≠as, no es un estadio a futuro al que llegaremos un d√≠a m√°gico, ¬°no!, todos los d√≠as avanzamos construy√©ndolo y derrotando al capitalismo.', 'Firma de acuerdos, convenios y memorandos de entendimiento en el marco del ALBA y el TCP. Patio Central del Palacio de Gobierno de La Paz, Bolivia.; 26 de mayo de 2006.', 'img/chavez/138.png');
INSERT INTO frases_chavez VALUES (139, 'El socialismo del siglo XXI es una invenci√≥n que est√° en pleno desarrollo, no hay f√≥rmulas, se requiere mucha inventiva, creatividad y, sobre todo, conciencia.', 'Conferencia de prensa del presidente Ch√°vez. Residencia del Embajador de Venezuela, Quito, Ecuador. 30 de mayo de 2006.', 'img/chavez/139.png');
INSERT INTO frases_chavez VALUES (140, 'Hay que demoler los restos de la IV Rep√∫blica para terminar de construir la V Rep√∫blica, la Rep√∫blica socialista y bolivariana.', 'Marcha y concentraci√≥n ‚ÄúEl rugido de los precursores. Plaza Bicentenaria del Palacio de Miraflores. 3 de junio de 2006.', 'img/chavez/140.png');
