INSERT INTO frases_chavez VALUES (142, 'S√≥lo el socialismo integra a la naturaleza y al ser humano, y nos permitir√° restituir el equilibrio perdido.', 'Al√≥ Presidente N¬∞ 257. Parque Nacional El √Åvila, 4 de junio de 2006.', 'img/chavez/142.png');
INSERT INTO frases_chavez VALUES (148, 'Vean c√≥mo termin√≥ Cristo: enfrentado al capitalismo y al imperialismo.', 'Al√≥ Presidente N¬∫ 258. Villa Bruzual, estado Portuguesa; 11 de junio de 2006.', 'img/chavez/035.png');
INSERT INTO frases_chavez VALUES (144, 'La cogesti√≥n por s√≠ sola no basta, porque no es garant√≠a de que hayamos salido del sistema capitalista, ¬°no!, m√°s all√° est√° el compromiso del trabajo social y el cambio de las relaciones de producci√≥n.', 'Pago de prestaciones sociales 2002-2003 al personal docente, administrativo y obrero de las universidades nacionales. Sal√≥n Ayacucho, Palacio de Miraflores; 8 de junio de 2006.', NULL);
