INSERT INTO frases_chavez VALUES (147, 'El socialismo robinsoniano es una de las m√°s poderosas ra√≠ces del nuevo socialismo del siglo XXI que hemos comenzado a construir en Venezuela.', 'Entrega de titularidad a docentes del estado Zulia Plaza de Toros Monumental de Maracaibo; 10 de junio de 2006.', NULL);
INSERT INTO frases_chavez VALUES (153, 'La universidad que necesitamos debe estar al servicio del pueblo, al servicio del proyecto nacional de desarrollo; no al servicio de intereses particulares o de las √©lites. ¬°Es la universidad para la transformaci√≥n!', 'Declaraciones del presidente Ch√°vez durante la inauguraci√≥n de Aldeas Universitarias 5 de abril de 2006', NULL);
