INSERT INTO frases_chavez VALUES (213, '¬°En Am√©rica del Sur hay una rebeli√≥n de pueblo!', 'Entrevista radial de ALER (Asociaci√≥n Latinoamericana de Educaci√≥n Radiof√≥nica) al presidente de la Rep√∫blica Bolivariana de Venezuela, Hugo Ch√°vez. Asunci√≥n, Paraguay; 19 de abril de 2006.', NULL);
INSERT INTO frases_chavez VALUES (190, 'El imperio norteamericano fue derrotado en Venezuela cuando se estrell√≥ contra el coraje del pueblo que ha recuperado su libertad y est√° dispuesto a ser libre. ¬°Venezuela m√°s nunca ser√° una colonia norteamericana!', 'Encuentro del presidente Ch√°vez con el Movimiento ‚ÄúManos Fuera de Venezuela. Viena, Austria; 12 mayo de 2006.', 'img/chavez/107.png');
INSERT INTO frases_chavez VALUES (215, 'Debemos fundamentarnos en la solidaridad, la cooperaci√≥n y la complementariedad, en lugar de la competencia; s√≥lo por ese camino lograremos una verdadera integraci√≥n en Mercosur y en la Uni√≥n Suramericana.', 'Rueda de prensa entre el Presidente Hugo Ch√°vez y el presidente electo de la Rep√∫blica de Hait√≠, Ren√© Preval. Palacio de Miraflores, 24 de abril de 2006.', NULL);
INSERT INTO frases_chavez VALUES (218, 'El gasoducto debe ser la locomotora de un proceso nuevo de integraci√≥n, cuyo principal objetivo sea derrotar la pobreza y la exclusi√≥n.', 'Conferencia de Prensa del presidente Ch√°vez con medios nacionales e internacionales. Sao Paulo, Brasil; 26 de abril de 2006.', NULL);
INSERT INTO frases_chavez VALUES (220, 'La integraci√≥n del Sur es vital para todos nuestros pueblos.', 'Llegada del presidente Ch√°vez a Brasil. Sao Paulo, Brasil; 26 de abril de 2006.', NULL);
INSERT INTO frases_chavez VALUES (223, 'No descansaremos en la tarea de la integraci√≥n.', 'Al√≥ Presidente N¬∞ 254. Barquisimeto, estado Lara; 7 de mayo de 2006.', NULL);
INSERT INTO frases_chavez VALUES (224, 'El Mega Gasoducto del Sur, as√≠ como aquella asociaci√≥n del hierro y el carb√≥n, por all√° en los a√±os 50 en Europa, se conform√≥ en el eje que impuls√≥ la integraci√≥n de la Uni√≥n Europea; se va a convertir en el eje central de nuestra integraci√≥n.', 'Encuentro del presidente Ch√°vez con miembros del Instituto Internacional para la Paz. Viena, Austria; 11 de mayo de 2006.', NULL);
INSERT INTO frases_chavez VALUES (225, 'Un mundo con un solo polo de fuerza es el mundo del caos, lo cual ha ocurrido con el imperio norteamericano, que pretende ser el polic√≠a universal.', 'Entrevista al presidente Ch√°vez por Channel 4 News. Londres, Inglaterra; 15 de mayo de 2006.', NULL);
INSERT INTO frases_chavez VALUES (229, 'La Cruz del Sur est√° clarita en el horizonte, con sus dos estrellas laterales, Alfa Centauro y Beta Centauro‚Ä¶ all√°, sobre el horizonte de agua del delta infinito y hermoso del Orinoco‚Ä¶uno mira la Cruz del Sur y piensa: para all√° es que vamos nosotros.', 'Al√≥ Presidente N¬∫ 255. Ciudad Guayana, estado Bol√≠var; 21 de mayo de 2006.', NULL);
INSERT INTO frases_chavez VALUES (232, 'Creo que lleg√≥ la hora de conformar una poderos√≠sima organizaci√≥n ind√≠gena latinoamericana, desde Guatemala hasta el R√≠o de La Plata.', 'Al√≥ Presidente N¬∞ 256. Ciudad Sagrada de Tiwanaku, Bolivia; 28 de mayo de 2006.', NULL);
INSERT INTO frases_chavez VALUES (234, '¬°Gracias a Dios!, los pueblos de Am√©rica Latina est√°n despertando. ¬°Gracias a Dios!, nuevos gobiernos est√°n llegando, con conciencia verdaderamente social, popular, con conciencia de nuestra historia.', 'Al√≥ Presidente N¬∫ 258. Villa Bruzual, estado Portuguesa; 11 de junio de 2006.', NULL);
INSERT INTO frases_chavez VALUES (235, 'Que la bandera venezolana tenga cada d√≠a mayor presencia, y adem√°s que nos vean como un factor de integraci√≥n, es muy positivo, porque impulsa la moral del pueblo.', 'Rueda de prensa del presidente Ch√°vez. Hotel C√¶sar Park, Rep√∫blica de Panam√°; 23 de junio de 2006.', NULL);
INSERT INTO frases_chavez VALUES (239, 'Debemos pasar a una nueva etapa donde se imponga, no la competencia entre nuestros pa√≠ses, sino el principio de la solidaridad, la cooperaci√≥n y la complementariedad entre nuestras econom√≠as.', 'Entrevista radial de ALER (Asociaci√≥n Latinoamericana de Educaci√≥n Radiof√≥nica) al presidente de la Rep√∫blica Bolivariana de Venezuela, Hugo Ch√°vez. Asunci√≥n, Paraguay; 19 de abril de 2006.', NULL);
INSERT INTO frases_chavez VALUES (240, 'La Misi√≥n Barrio Adentro es ejemplo supremo, sublime y brillante de un nuevo y necesario modelo de integraci√≥n: ¬°estamos construyendo el ALBA!', 'Acto con motivo del III Aniversario de la Misi√≥n Barrio Adentro. Teatro Municipal de Caracas, 21 de abril de 2006.', NULL);
INSERT INTO frases_chavez VALUES (241, 'No es a trav√©s del comercio que nos vamos a unir, es a trav√©s de la pol√≠tica y, sobre todo, con la participaci√≥n de nuestros pueblos.', 'Declaraciones del presidente Ch√°vez. Iguaz√∫, Argentina; 4 de mayo de 2006.', NULL);
INSERT INTO frases_chavez VALUES (242, 'El petr√≥leo hasta ahora ha sido un arma para dominar a los pueblos. Nosotros planteamos el petr√≥leo como arma para liberarlos.', 'Encuentro del presidente Ch√°vez con el pueblo italiano luego de su visita al Parlamento Italiano. Roma, Italia; 10 de mayo de 2006.', NULL);
INSERT INTO frases_chavez VALUES (244, 'Ha fracasado el Consenso de Washington, que ha sumido en mayor miseria y pobreza a la Am√©rica Latina. Nosotros hemos propuesto un nuevo modelo de integraci√≥n que ponga por delante lo social, y le hemos llamado ALBA.', 'Declaraciones del presidente Ch√°vez a la salida de la reuni√≥n con la presidenta de Chile, Michelle Bachelet. Viena, Austria; 11 de mayo de 2006.', NULL);
INSERT INTO frases_chavez VALUES (219, 'El mundo necesita a la Am√©rica Latina unida.', 'Hugo Rafael Ch√°vez Fr√≠as', NULL);
INSERT INTO frases_chavez VALUES (237, 'Estados Unidos est√° proponiendo tratados de coloniaje, nosotros tratados de liberaci√≥n y comercio, pero no libre comercio, ¬°no!, comercio con justicia.', 'Al√≥ Presidente N¬∞ 251. Hato San Pablo Pae√±o, estado Apure; 2 de abril de 2006.', 'img/chavez/019.png');
INSERT INTO frases_chavez VALUES (221, 'No tenemos otra alternativa que la integraci√≥n para insertarnos con posibilidad de √©xito en este mundo globalizado, para sacar a nuestros pueblos del atraso y la miseria, y llevar adelante un verdadero proyecto nacional, latinoamericano, de desarrollo integral, a un mundo en equilibrio y, por tanto, en paz.', 'Rueda de Prensa. Encuentro cuatrilateral de los presidentes de Argentina, Bolivia, Brasil y Venezuela. Iguaz√∫, Argentina; 4 de mayo de 2006.', 'img/chavez/112.png');
INSERT INTO frases_chavez VALUES (247, 'Europa debe entender que en Am√©rica Latina, afortunadamente para nuestros pueblos, fracas√≥ el Consenso de Washington.', 'Declaraciones del presidente Ch√°vez luego de la inauguraci√≥n de la IV Cumbre de Jefes de Estado y de Gobierno de Am√©rica Latina, el Caribe y la Uni√≥n Europea. Viena, Austria; 11 de mayo de 2006.', NULL);
INSERT INTO frases_chavez VALUES (249, 'El proyecto neoliberal est√° en fuga en Am√©rica Latina. Ahora se impone un Estado nacional sustentado en la voluntad popular.', 'Rueda de Prensa con la prensa italiana y agencias internacionales. Hotel Parco dei Principi, Roma, Italia; 11 de mayo 2006.', NULL);
INSERT INTO frases_chavez VALUES (250, 'Movimientos revolucionarios y transformadores van ocupando el poder en Am√©rica Latina, en un rechazo abierto a las pol√≠ticas fracasadas de Washington.', 'Entrevista al presidente Ch√°vez por Channel 4 News. Londres, Inglaterra; 15 de mayo de 2006.', NULL);
INSERT INTO frases_chavez VALUES (251, 'El ALCA es la m√°s refinada propuesta imperialista que conozca la historia, ni el Imperio Romano le aplicaba a sus colonias o a las regiones conquistadas un mecanismo como este.', 'Al√≥ Presidente N¬∫ 255. Ciudad Guayana, estado Bol√≠var; 21 de mayo de 2006.', NULL);
INSERT INTO frases_chavez VALUES (253, 'Al oponerse al ALCA, Venezuela est√° defendiendo los intereses de todo el pa√≠s, incluyendo al sector privado nacional, que ser√≠a arrasado en una competencia desleal y salvaje por las grandes corporaciones transnacionales, sobre todo por los monopolios imperialistas.', 'Al√≥ Presidente N¬∫ 255. Ciudad Guayana, estado Bol√≠var; 21 de mayo de 2006.', NULL);
INSERT INTO frases_chavez VALUES (255, 'Desde Washington conspiran contra nosotros, inventan historietas de todo tama√±o y de todo color, forjan documentos, inventan pruebas falsas y sin embargo, Venezuela sigue avanzando en la integraci√≥n.', 'Conferencia de prensa del presidente Ch√°vez. Residencia del Embajador de Venezuela. Quito, Ecuador. 30 de mayo de 2006.', NULL);
INSERT INTO frases_chavez VALUES (258, 'Nos impusieron una doctrina extra√±a y contraria a nosotros mismos, contraria a nuestras ra√≠ces libertadoras, a nuestras ra√≠ces antiimperialistas, y eso tenemos que terminar de sacudirlo; as√≠ como a un exorcismo.', 'Intervenci√≥n en el inicio del curso de Comando y Estado Mayor Conjunto Teatro Teresa Carre√±o, 10 de enero de 2006', NULL);
INSERT INTO frases_chavez VALUES (260, 'En el buque Leander no naci√≥ el mariscal Miranda, ya exist√≠a; no naci√≥ el revolucionario Miranda, ya lo era; pero s√≠ naci√≥ el primer suramericano libre, el primer gran l√≠der de la revoluci√≥n suramericana.', 'Mensaje Anual a la Naci√≥n Asamblea Nacional, 13 de enero de 2006', NULL);
INSERT INTO frases_chavez VALUES (261, 'De Sim√≥n Bol√≠var extraemos la iluminaci√≥n m√°s grande para esta misi√≥n; la Negra Hip√≥lita es la madre y es el padre de un pueblo, de quienes viven en la miseria.', 'Intervenci√≥n durante el lanzamiento de la Misi√≥n Negra Hip√≥lita Teatro Teresa Carre√±o, 14 de enero de 2006', NULL);
INSERT INTO frases_chavez VALUES (262, 'No haremos el futuro grande que estamos buscamos si no conocemos el pasado grande que tuvimos.', 'Al√≥ Presidente N¬∫ 244. Palacio de Miraflores, 15 de enero de 2006.', NULL);
INSERT INTO frases_chavez VALUES (264, 'Am√©rica Latina ha iniciado de nuevo el mismo proceso que qued√≥ pendiente a Bol√≠var, San Mart√≠n, O‚ÄôHiggins y Artigas: la Independencia.', 'Acto por la Lucha Antiimperialista de los Pueblos VI Foro Social Mundial Poliedro de Caracas, 27 de enero de 2006.', NULL);
INSERT INTO frases_chavez VALUES (266, 'Sim√≥n Bol√≠var es el autor intelectual del 4 de febrero de 1992, de la rebeli√≥n bolivariana de los j√≥venes soldados venezolanos.', 'Intervenci√≥n en la entrega del Premio Internacional de la Unesco ‚ÄúJos√© Mart√≠ ', NULL);
INSERT INTO frases_chavez VALUES (269, 'El 27 de febrero de 1989 le toc√≥ al pueblo venezolano abrir el camino; le toc√≥ aportar su cuota de sacrificio, sangre y dolor para dar inicio a la Revoluci√≥n Bolivariana.', 'D√≠a de la Dignidad y de la Rebeli√≥n Bolivariana Avenida Bol√≠var de Caracas. 4 de febrero de 2006.', NULL);
INSERT INTO frases_chavez VALUES (272, 'Los soldados venezolanos estamos aqu√≠ para cumplir el mandato de Sim√≥n Bol√≠var, para empu√±ar nuestra espada cuando tengamos que empu√±arla, para defender las garant√≠as, la felicidad y la libertad de un pueblo, no para dominarlo, ultrajarlo o atropellarlo.', 'D√≠a de la Dignidad y de la Rebeli√≥n Bolivariana Avenida Bol√≠var de Caracas. 4 de febrero de 2006.', NULL);
INSERT INTO frases_chavez VALUES (273, 'Nuestra Revoluci√≥n viene de lejos: es la de Bol√≠var y es la de Zamora. Se hab√≠a apagado, pero estaba avanzando por debajo de la tierra como esos r√≠os subterr√°neos que de repente salen de entre las rocas de una monta√±a y cogen sabana.', 'Acto con motivo de la entrega de pensiones de vejez Palacio de Miraflores, 17 de febrero de 2006.', NULL);
INSERT INTO frases_chavez VALUES (254, 'Los Tratados de Libre Comercio son un mecanismo neocolonialista, que buscan adue√±arse de las riquezas naturales de nuestros pa√≠ses e imponernos el modelo hegem√≥nico del imperialismo norteamericano.', 'Acto de masas con motivo de la visita del presidente Ch√°vez a la Rep√∫blica de Bolivia. Cochabamba, Bolivia; 26 de mayo de 2006.', 'img/chavez/031.png');
INSERT INTO frases_chavez VALUES (248, 'Ojal√° la ‚Äòchequera gorda gringa‚Äô, en vez de aterrorizar a los pueblos del mundo con bombas inteligentes e invasiones, la utilizaran para generar vida y educaci√≥n como lo hacemos nosotros, movidos por la solidaridad.', 'Llegada del presidente Ch√°vez al Hotel Hilton Danube. ', 'img/chavez/141.png');
INSERT INTO frases_chavez VALUES (265, 'Nacimos al calor de las doctrinas libertadoras y humanistas de Francisco de Miranda, Antonio Jos√© de Sucre, Sim√≥n Bol√≠var y Ezequiel Zamora. ¬°√âsas son nuestras ra√≠ces militares, las ra√≠ces de nuestro pensamiento antiimperialista, humanista y libertador!', 'Desfile civicomilitar en ocasi√≥n del Septimo aniversario del Gobierno Bolivariano Patio de Honor de la Academia Militar, 2 de febrero de 2006.', 'img/chavez/049.png');
INSERT INTO frases_chavez VALUES (275, 'Hay que revisar la historia, incluso en el marco del capitalismo, ¬øser√° que esos pa√≠ses del Norte se desarrollaron al nivel que llegaron en ese marco de libre comercio? ¬°No! Nunca creyeron ni creen en √©l: Es una gran falacia.', 'Conferencia de prensa de los presidentes de Venezuela y Uruguay Palacio de Miraflores, 14 de marzo de 2006', NULL);
