INSERT INTO frases_chavez VALUES (277, 'La ra√≠z zamorana, la ra√≠z bolivariana y la ra√≠z robinsoniana: tres ra√≠ces de un mismo tronco y un √°rbol enraizado en el pensamiento nacional; ideolog√≠a que impulsa el nuevo y verdadero bolivarianismo.', 'Al√≥ Presidente N¬∞ 250 Valles del Tuy, 26 de marzo de 2006', NULL);
INSERT INTO frases_chavez VALUES (278, 'Estamos comenzando a mirar lo que el padre Libertador imaginaba: una inmensa regi√≥n donde debe reinar la justicia, la igualdad y la libertad, ¬°f√≥rmula m√°gica para la vida de las naciones y la paz entre los pueblos!', 'Inauguraci√≥n de La Central Hidroel√©ctrica Caruachi, estado Bol√≠var; 31 de marzo de 2006', NULL);
INSERT INTO frases_chavez VALUES (288, 'Cuando llegamos al gobierno, la inversi√≥n en educaci√≥n no llegaba ni siquiera al 3% del Producto Interno Bruto; hoy estamos cerca del 8%.', 'Conmemoraci√≥n de los 7 a√±os del gobierno del presidente Hugo Ch√°vez Fr√≠as Teatro Teresa Carre√±o, 2 de febrero de 2002', NULL);
INSERT INTO frases_chavez VALUES (289, 'Cada d√≠a voy a apurar m√°s el paso. El que no pueda seguirme el ritmo que se vaya a otras cosas. No voy a frenar, porque as√≠ lo clama el pueblo.', 'D√≠a de la dignidad y la Rebeli√≥n Bolivariana Avenida Bol√≠var de Caracas. 4 de febrero de 2006', NULL);
