INSERT INTO frases_chavez VALUES (296, '¬°No habr√° Revoluci√≥n sin juventud revolucionaria!, ¬°no habr√° Patria sin juventud patri√≥tica!', 'Inauguraci√≥n de la Universidad Iberoamericana del Deporte San Carlos, estado Cojedes, 9 de febrero de 2006', NULL);
INSERT INTO frases_chavez VALUES (297, 'Tenemos el deber de buscar mil maneras y m√°s para darle al pueblo la vida que necesita.', 'Entrega de Certificados de Vivienda del N√∫cleo de Desarrollo End√≥geno Habitacional ‚ÄúPatria Bolivariana Maracaibo, 9 de febrero de 2006', NULL);
INSERT INTO frases_chavez VALUES (300, '¬°No habr√° Revoluci√≥n sin juventud revolucionaria!, ¬°no habr√° Patria sin juventud patri√≥tica!', 'Inauguraci√≥n de la Universidad Iberoamericana del Deporte San Carlos, estado Cojedes, 9 de febrero de 2006', NULL);
INSERT INTO frases_chavez VALUES (301, 'Tenemos el deber de buscar mil maneras y m√°s para darle al pueblo la vida que necesita.', 'Entrega de Certificados de Vivienda del N√∫cleo de Desarrollo End√≥geno Habitacional ‚ÄúPatria Bolivariana‚Äù Maracaibo, 9 de febrero de 2006', NULL);
