INSERT INTO frases_chavez VALUES (317, 'Cada d√≠a los pueblos van tomando mayor conciencia‚Ä¶ y los resultados est√°n a la vista.', 'Rueda de prensa ofrecida por el Presidente Ch√°vez y el Presidente electo de Bolivia, Evo Morales, Palacio de Miraflores, 3 de enero de 2006', NULL);
