INSERT INTO frases_chavez VALUES (331, 'Tengo plena fe en el pueblo venezolano y sus grandes capacidades: verdadero Libertador de Venezuela, ¬°verdadero creador de la Patria nueva!', 'Primer Gabinete M√≥vil Comunal, Teatro Teresa Carre√±o, 06 de Febrero de 2006', NULL);
