INSERT INTO frases_chavez VALUES (338, 'Los l√≠deres deben escuchar el clamor de sus pueblos.', 'Activaci√≥n de la Planta Termoel√©ctrica ‚ÄúPedro Camejo‚Äù Valencia, Edo. Carabobo; 21 de marzo de 2006', NULL);
INSERT INTO frases_chavez VALUES (307, 'La corrupci√≥n existe, y yo soy el primero en ponerme al frente y llamar al pa√≠s a batallar contra ella en todos los frentes.', 'Al√≥ Presidente Nro. 248 Municipio Acevedo, Estado Miranda; 5 de marzo de 2006', 'img/chavez/125.png');
INSERT INTO frases_chavez VALUES (314, 'Pido a todos la mayor dedicaci√≥n posible para incrementar la eficiencia del Proceso Revolucionario en el √°mbito pol√≠tico: No olvidemos que debemos trascender la democracia meramente representativa en democracia participativa, en democracia protag√≥nica, en Democracia Revolucionaria.', 'Inauguraci√≥n del Centro M√©dico de Diagn√≥stico de Alta Tecnolog√≠a ‚Äú10 de Marzo‚Äù La Guaira, 23 de marzo de 2006', NULL);
INSERT INTO frases_chavez VALUES (311, 'Hacia el norte: latifundio cero; hacia el sur: latifundio cero; hacia el este: latifundio cero; hacia el oeste: latifundio cero. Esa tarea no es s√≥lo de Ch√°vez, es una tarea de todos, cueste lo que cueste, para dejar una Patria libre de tantas r√©moras que pretenden ahogarla.', 'Al√≥ Presidente Nro. 249 Elorza, estado Apure; 19 de marzo de 2006', NULL);
INSERT INTO frases_chavez VALUES (316, 'Un gobierno apuntalado por su pueblo jam√°s caer√°.', 'Hugo Rafael Ch√°vez Fr√≠as', NULL);
INSERT INTO frases_chavez VALUES (308, '√âramos una colonia petrolera, depend√≠amos de las decisiones que se tomaban en los Estados Unidos. Ahora no; es voluntad de nuestro Gobierno, de nuestro proceso revolucionario, de nuestro pueblo, virar hacia el Sur, y hemos comenzado a hacerlo.', 'Conferencia de prensa de los presidentes de Venezuela y Uruguay Palacio de Miraflores, 14 de marzo de 2006', 'img/chavez/103.png');
INSERT INTO frases_chavez VALUES (329, 'El poder popular es parte del poder militar, porque sin pueblo una Fuerza Armada est√° destinada al fracaso.', 'Al√≥ Presidente N¬∫ 246, Cuman√°, 5 febrero 2006', 'img/chavez/049.png');
INSERT INTO frases_chavez VALUES (339, 'Uno de los elementos fundamentales del poder popular, es la capacidad del pueblo para hacer su propio diagn√≥stico social, elaborar sus propios proyectos comunitarios y solicitar el apoyo que nosotros estamos obligados a darle.', 'Inauguraci√≥n del Centro M√©dico de Diagn√≥stico de Alta Tecnolog√≠a ‚Äú10 de Marzo‚Äù La Guaira, 23 de marzo de 2006', NULL);
INSERT INTO frases_chavez VALUES (340, 'Una poderosa fuerza se levant√≥ y comenz√≥ a imprimirle ritmo y direcci√≥n a un proceso, y no habr√° fuerza capaz de detenerlo, porque se alimenta de la energ√≠a maravillosa que genera la conciencia de un pueblo.', 'Firma de acuerdos para la migraci√≥n de los convenios operativos a las empresas mixtas Palacio de Miraflores, 31 de marzo de 2006', NULL);
INSERT INTO frases_chavez VALUES (346, 'Bienvenido el error, para reconocerlo, combatirlo y convertirlo en nueva invenci√≥n; mal venido el enga√±o, porque es mortal para un proceso revolucionario.', 'Participaci√≥n del inicio del nuevo per√≠odo de sesiones ordinarias 2006 y presentaci√≥n de la nueva Junta Directiva de la Asamblea Nacional al Poder Ejecutivo, Palacio Blanco, 6 de enero de 2006', NULL);
INSERT INTO frases_chavez VALUES (347, 'No estamos en tiempos de posiciones defensivas, estamos en tiempos de ataque, en tiempos de ofensiva.', 'Intervenci√≥n en la entrega del Premio Internacional de la UNESCO ‚ÄúJos√© Mart√≠‚Äù, La Habana, 3 de febrero de 2006', NULL);
INSERT INTO frases_chavez VALUES (348, 'Nosotros, los que luchamos por un mundo distinto y mejor; nosotros, los que levantamos las banderas de la revoluci√≥n, estamos en la ofensiva. Los que defienden la injusticia y la desigualdad, est√°n en retirada.', 'Acto por la Lucha Antiimperialista de los Pueblos VI Foro Social Mundial. Caracas, 27 de enero de 2006', NULL);
INSERT INTO frases_chavez VALUES (350, 'Aceleremos la inversi√≥n y el desarrollo cultural; no hay revoluci√≥n sin un impulso cultural pleno, grande, extendido en todo el pa√≠s.', 'Conmemoraci√≥n de los 7 a√±os del gobierno del presidente Hugo Ch√°vez Fr√≠as, Teatro Teresa Carre√±o, 2 de febrero de 2002', NULL);
INSERT INTO frases_chavez VALUES (355, '¬°Unidad! ¬°Unidad! ¬°Unidad! Para salvar la patria, para salvar la revoluci√≥n, para salvar el futuro.', 'Al√≥ Presidente N¬∫ 246, Cuman√°, 5 febrero 2006', NULL);
INSERT INTO frases_chavez VALUES (357, 'Llamo a la unidad de todos los venezolanos para defender nuestra patria, nuestra soberan√≠a y darle continuidad a este proyecto de transformaci√≥n profunda.', 'Al√≥ Presidente N¬∫ 246, Cuman√°, 5 febrero 2006', NULL);
INSERT INTO frases_chavez VALUES (359, 'Estamos atacando la pobreza y la miseria por distintas v√≠as; s√≥lo as√≠ podremos dar el gran salto adelante que necesitamos, enfrentando todos los problemas al mismo tiempo, siempre con la moral por delante.', 'Primer Gabinete M√≥vil Comunal, Teatro Teresa Carre√±o, 06 de Febrero de 2006', NULL);
INSERT INTO frases_chavez VALUES (360, 'Estamos librando una gran batalla pol√≠tica, de la cual depende la continuidad de nuestro proyecto nacional de desarrollo end√≥geno bolivariano.', 'Rendici√≥n de Cuentas de los Proyectos Comunitarios y Nuevos Proyectos en Conjunto, Teatro Teresa Carre√±o, 10 de febrero de 2006', NULL);
INSERT INTO frases_chavez VALUES (362, 'No debe haber sectarismo posible cuando se trata de un esfuerzo como el que estamos haciendo, en el cual lo importante es el colectivo mucho m√°s que el protagonismo de alguien.', 'Juramentaci√≥n de los ministros de Industrias Ligeras y Comercio, Agricultura y Tierras, Trabajo para la Econom√≠a Popular, Alimentaci√≥n y Despacho de la Presidencia, Palacio de Miraflores, 24 de febrero de 2006', NULL);
INSERT INTO frases_chavez VALUES (365, 'La mayor parte de los medios de comunicaci√≥n privados del mundo, pertenecen a √©lites que s√≥lo defienden sus intereses y utilizan sus recursos como poderosos ca√±ones de artiller√≠a contra la verdad.', 'Juramentaci√≥n de nuevos embajadores, Palacio de Miraflores, 7 de marzo de 2006', NULL);
INSERT INTO frases_chavez VALUES (367, 'Hay que transformar el sistema, el modelo, porque no basta con el crecimiento, eso es un mito y una trampa; es la distribuci√≥n de la riqueza la que hay que cambiar plenamente.', 'Rueda de prensa ofrecida por el Presidente Ch√°vez y el Presidente electo de Bolivia, Evo Morales, Palacio de Miraflores, 3 de enero de 2006', NULL);
INSERT INTO frases_chavez VALUES (368, 'El 2006 es el a√±o de profundizaci√≥n de la estrategia del desarrollo integral end√≥geno, donde lo m√°s importante es lo humano.', 'Al√≥ Presidente N¬∫ 243, N√∫cleo de Desarrollo End√≥geno Jos√© F√©lix Ribas, Estado Aragua, 8 de enero de 2006', NULL);
INSERT INTO frases_chavez VALUES (370, 'El pueblo debe controlar los poderes y crear herramientas para frenarlos cuando haya que frenarlos, cambiarlos cuando haya que cambiarlos, reestructurarlos cuando haya que reestructurarlos.', 'Presentaci√≥n del Mensaje Anual a la Naci√≥n, Asamblea Nacional, 13 de enero de 2006', NULL);
INSERT INTO frases_chavez VALUES (354, 'Recuerden, compatriotas: esta batalla va a ser muy dura, porque no estamos batallando contra los factores de la oposici√≥n pol√≠tica venezolana, no estamos batallando tampoco contra los medios de comunicaci√≥n; ¬°no!, realmente estamos enfrentando al imperio norteamericano.', 'D√≠a de la dignidad y la Rebeli√≥n Bolivariana, Avenida Bol√≠var de Caracas. 4 de febrero de 2006', NULL);
INSERT INTO frases_chavez VALUES (363, 'Una Fuerza Armada que no est√© en el coraz√≥n de un pueblo, est√° destinada al fracaso.', 'Al√≥ Presidente Nro. 248, Municipio Acevedo, Estado Miranda; 5 de marzo de 2006', 'img/chavez/049.png');
INSERT INTO frases_chavez VALUES (373, 'Este planeta se salva por el camino de un nuevo socialismo que aqu√≠ estamos comenzando a construir.', 'Al√≥ Presidente N¬∫ 245, Parroquia Ant√≠mano, 29 de enero de 2006', NULL);
INSERT INTO frases_chavez VALUES (374, 'Hoy tenemos una sociedad totalmente distinta a aquella de exclusi√≥n y privilegios, en la cual privatizaban la salud, la educaci√≥n y los servicios p√∫blicos; en estos siete a√±os, hemos borrado del mapa nacional la sola idea de la privatizaci√≥n de Venezuela.', 'Conmemoraci√≥n de los 7 a√±os del gobierno, del presidente Hugo Ch√°vez Fr√≠as. Teatro Teresa Carre√±o, 2 de febrero de 2002', NULL);
INSERT INTO frases_chavez VALUES (375, 'La importancia de la organizaci√≥n comunitaria es que nos permitir√° salir del individualismo.', 'Primer Gabinete M√≥vil Comunal, Teatro Teresa Carre√±o, 06 de Febrero de 2006', NULL);
INSERT INTO frases_chavez VALUES (377, 'Este proyecto nacional bolivariano va rumbo a un socialismo nuevo. No se trata de copiar nada, tenemos que inventar nuestro propio modelo de desarrollo.', 'Inauguraci√≥n de la Universidad Iberoamericana del Deporte, San Carlos, 9 de febrero de 2006', NULL);
INSERT INTO frases_chavez VALUES (379, 'El socialismo es una corriente profundamente humanista; el capitalismo es inhumano.', 'Entrega de Certificados de Vivienda del N√∫cleo de Desarrollo End√≥geno Habitacional ‚ÄúPatria Bolivariana‚Äù Maracaibo, 9 de febrero de 2006', NULL);
INSERT INTO frases_chavez VALUES (382, 'El Reino de Dios no es otro que el reino del socialismo verdadero, aut√©ntico, un reino donde no haya clases sociales ni groseros privilegios.', 'Al√≥ Presidente Nro. 247, Ciudad Guayana, 19 de febrero de 2006', NULL);
INSERT INTO frases_chavez VALUES (383, 'La revoluci√≥n es un instrumento para lograr fines mayores: la independencia, el desarrollo integral, el progreso social, el desarrollo de una nueva sociedad.', 'Activaci√≥n de la Planta Termoel√©ctrica ‚ÄúPedro Camejo‚Äù, Valencia, Edo. Carabobo; 21 de marzo de 2006', NULL);
INSERT INTO frases_chavez VALUES (384, 'Tiene que haber una revoluci√≥n pol√≠tica; tiene que haber una revoluci√≥n econ√≥mica tambi√©n, pero la esencia de la Revoluci√≥n es lo social, la conformaci√≥n de una nueva sociedad.', 'Inauguraci√≥n del Centro M√©dico de Diagn√≥stico, de Alta Tecnolog√≠a ‚Äú10 de Marzo‚Äù. La Guaira, 23 de marzo de 2006', NULL);
INSERT INTO frases_chavez VALUES (387, 'La causa esencial de la Revoluci√≥n Bolivariana es buscar m√°s y mejor nivel de vida para todos, en la lucha por instalar en Venezuela un nuevo sistema social, econ√≥mico, pol√≠tico: el socialismo criollo, a lo venezolano.', 'Inauguraci√≥n del Centro M√©dico de Diagn√≥stico de Alta Tecnolog√≠a ‚Äú10 de Marzo‚Äù. La Guaira, 23 de marzo de 2006', NULL);
INSERT INTO frases_chavez VALUES (390, 'Igualdad y libertad: ra√≠ces del socialismo que estamos planteando al mundo.', 'Al√≥ Presidente N¬∞ 250, Valles del Tuy, 26 de marzo de 2006', NULL);
INSERT INTO frases_chavez VALUES (392, 'Nuestra lucha es por la integraci√≥n suramericana, la integraci√≥n latinoamericana. S√≥lo unidos seremos libres y podremos enfrentarnos a los gigantes del mundo; esta es una regi√≥n del mundo que naci√≥ para ser grande y para ser libre.', 'Inicio del curso de Comando y Estado Mayor Conjunto e inicio de las actividades acad√©micas militares. Teatro Teresa Carre√±o, 10 de enero de 2006', NULL);
INSERT INTO frases_chavez VALUES (393, 'Somos absolutamente respetuosos de la soberan√≠a de todos y cada uno de los pa√≠ses del mundo, particularmente de nuestros vecinos y hermanos; hermanos pueblos, hermanos pa√≠ses y hermanas rep√∫blicas.', 'Presentaci√≥n del Mensaje Anual a la Naci√≥n. Asamblea Nacional, 13 de enero de 2006', NULL);
INSERT INTO frases_chavez VALUES (394, 'Hay que incorporar las grandes corrientes populares, campesinas, ind√≠genas, de trabajadores, juventudes, estudiantes, militares, partidos pol√≠ticos, parlamentos; hay que darle mayor fortaleza al nuevo Mercosur.', 'Llegada del Presidente Ch√°vez al III Encuentro Trilateral Venezuela-Argentina-Brasil, Brasilia, 19 de enero de 2006', NULL);
INSERT INTO frases_chavez VALUES (395, 'En la medida en que seamos m√°s independientes, financiera y econ√≥micamente, podremos ayudarnos mucho mejor.', 'Declaraciones del Presidente Ch√°vez, Brasilia, 19 de enero de 2006', NULL);
INSERT INTO frases_chavez VALUES (399, 'Tengo la certeza de que ahora s√≠ lleg√≥ la hora de nuestros pueblos, y cuando digo ahora, estoy pensando en este siglo XXI, el siglo de nuestra redenci√≥n, nuestra unidad, nuestra independencia plena como Regi√≥n, como pueblo grande, como Patria Grande.', 'Intervenci√≥n en la entrega del Premio Internacional de la UNESCO ‚ÄúJos√© Mart√≠‚Äù, La Habana, 3 de febrero de 2006', NULL);
INSERT INTO frases_chavez VALUES (400, 'La integraci√≥n a lo Bol√≠var, a lo Mart√≠, s√≥lo es posible con gobiernos de izquierda en Am√©rica Latina.', 'Intervenci√≥n en la entrega del Premio Internacional, de la UNESCO ‚ÄúJos√© Mart√≠‚Äù, La Habana, 3 de febrero de 2006', NULL);
INSERT INTO frases_chavez VALUES (380, 'El socialismo bolivariano y cristiano que estamos comenzando a construir, tiene que reivindicar el concepto hermoso del trabajo. El capitalismo le quita lo hermoso al trabajo y lo degenera en un mecanismo de explotaci√≥n que convierte a los trabajadores en aut√≥matas.', 'Acto con motivo de la entrega de pensiones de vejez, Palacio de Miraflores, 17 de febrero de 2006', NULL);
INSERT INTO frases_chavez VALUES (397, 'Nos dividieron para dominarnos y aplicarnos el modelo de explotaci√≥n, dependencia y coloniaje.', 'Acto de Acuerdo Marco de Corresponsabilidad para la Transformaci√≥n Industrial. Sal√≥n Venezuela del C√≠rculo Militar, 20 de enero de 2006', 'img/chavez/079.png');
INSERT INTO frases_chavez VALUES (402, 'Est√°n intentando aislar a Venezuela. ¬°No podr√°n! Venezuela est√° acompa√±ada, m√°s que nunca antes en toda nuestra historia, por pueblos, gobiernos y movimientos populares y sociales.', 'D√≠a de la dignidad y la Rebeli√≥n Bolivariana, Avenida Bol√≠var de Caracas, 4 de febrero de 2006', NULL);
INSERT INTO frases_chavez VALUES (404, 'Mercosur debe elaborar una estrategia de complementaci√≥n de nuestras econom√≠as; contin√∫a imperando la terrible voracidad capitalista de la competencia de los mercados, y por ese camino no vamos a ninguna parte.', 'Firma de Acuerdos entre la Rep√∫blica Oriental del Uruguay y la Rep√∫blica Bolivariana de Venezuela, Palacio de Miraflores, 14 de marzo de 2006', NULL);
INSERT INTO frases_chavez VALUES (406, 'Suram√©rica, con el petr√≥leo que tenemos, con el gas que tenemos, con el pueblo que tenemos y la voluntad que debemos tener cada d√≠a m√°s grande de integraci√≥n, puede ser un polo petroqu√≠mico mundial, adem√°s de un polo agr√≠cola mundial.', 'Conferencia de prensa de los presidentes, de Venezuela y Uruguay, Palacio de Miraflores, 14 de marzo de 2006', NULL);
INSERT INTO frases_chavez VALUES (407, '¬°Nada ni nadie podr√° evitar que nuestros pueblos recuperen la dignidad! ¬°Nada ni nadie podr√° evitar que la Am√©rica Latina y el Caribe se enrumben hacia el destino superior que tienen se√±alado!', 'Inauguraci√≥n del Centro M√©dico de Diagn√≥stico, de Alta Tecnolog√≠a ‚Äú10 de Marzo‚Äù. La Guaira, 23 de marzo de 2006', NULL);
INSERT INTO frases_chavez VALUES (412, 'Los pueblos romperemos el esquema impuesto en Naciones Unidas, para que haya de verdad naciones libres, hermanas y unidas, y no una dictadura contra la mayor√≠a de los pueblos del mundo.', 'Juramentaci√≥n del Ministro de Comunicaci√≥n e Informaci√≥n y de los Embajadores ante la ONU y ante la Rep√∫blica de Bolivia, Palacio de Miraflores, 28 de marzo de 2006', NULL);
INSERT INTO frases_chavez VALUES (413, 'Est√°n volviendo los pueblos ind√≠genas; los m√°s oprimidos de esta tierra se han levantado y est√°n comenzando a construir una nueva p√°gina de la historia de la Am√©rica Latina y el Caribe, luego de siglos de explotaci√≥n, dominaci√≥n y atraso.', 'Inauguraci√≥n de La Central Hidroel√©ctrica Caruachi, estado Bol√≠var; 31 de marzo de 2006', NULL);
INSERT INTO frases_chavez VALUES (418, 'Hoy estamos viviendo los resultados crudos, dolorosos, de la imposici√≥n del llamado ‚Äòconsenso de Washington‚Äô: nunca hubo tanta miseria en Am√©rica Latina, nunca hubo tanta diferencia entre una minor√≠a enriquecida y una mayor√≠a empobrecida.', 'Acto de Acuerdo Marco de Corresponsabilidad para la Transformaci√≥n Industrial, Sal√≥n Venezuela del C√≠rculo Militar, 20 de enero de 2006', NULL);
INSERT INTO frases_chavez VALUES (420, 'Todos debemos unirnos, articularnos, en una ofensiva victoriosa contra el imperialismo.', 'Acto por la Lucha Antiimperialista de los Pueblos VI Foro Social Mundial, Caracas, 27 de enero de 2006', NULL);
INSERT INTO frases_chavez VALUES (427, 'La actitud imperialista, genocida y fascista del presidente de los Estados Unidos no tiene l√≠mites. Yo creo que Hitler ser√≠a un ni√±o de pecho delante de George W. Bush.', 'D√≠a de la dignidad y la Rebeli√≥n Bolivariana, Avenida Bol√≠var de Caracas. 4 de febrero de 2006', NULL);
INSERT INTO frases_chavez VALUES (416, 'La √∫nica guerra posible para nosotros, ser√≠a aquella que estar√≠amos obligados a hacer contra una invasi√≥n del imperialismo norteamericano. Para esa guerra tenemos que prepararnos desde el alma, desde las ra√≠ces de Guaicaipuro, Miranda, Bol√≠var, Zamora, desde la grandeza de nuestra historia, nuestros m√°rtires, nuestro pueblo.', 'Intervenci√≥n en el inicio del curso de Comando y Estado Mayor Conjunto, Teatro Teresa Carre√±o, 10 de enero de 2006', NULL);
INSERT INTO frases_chavez VALUES (422, 'Debemos seguir tres grandes l√≠neas estrat√©gicas: la primera, el fortalecimiento del poder militar de la naci√≥n; la segunda, la uni√≥n c√≠vico-militar; y la tercera, la incorporaci√≥n masiva del pueblo a las tareas del pensamiento, la capacitaci√≥n y el adiestramiento para la defensa nacional.', 'Desfile c√≠vico-militar en ocasi√≥n del s√©ptimo aniversario del Gobierno Bolivariano, Patio de Honor de la Academia Militar, 2 de febrero de 2006', 'img/chavez/049.png');
INSERT INTO frases_chavez VALUES (424, 'Es imprescindible, para que podamos ser verdaderamente libres y para que podamos volar unidos en libertad e igualdad, que caiga ese imperio y se levante nuestro imperio, que es el imperio de la justicia, la igualdad, la raz√≥n, la verdad, las ideas y las luces.', 'Intervenci√≥n en la entrega del Premio Internacional, de la UNESCO ‚ÄúJos√© Mart√≠‚Äù, La Habana, 3 de febrero de 2006', NULL);
INSERT INTO frases_chavez VALUES (403, 'La alianza entre Cuba y Venezuela s√≠ es un peligro: para el analfabetismo, las enfermedades, la pobreza y la miseria; un peligro para el dominio imperialista.', 'Acto con motivo de la entrega de pensiones de vejez, Palacio de Miraflores, 17 de febrero de 2006', 'img/chavez/107.png');
INSERT INTO frases_chavez VALUES (417, 'Hemos puesto en marcha una nueva doctrina militar en Venezuela: la guerra de todo el pueblo. Si aqu√≠ vienen a meterse con nosotros, no ser√° s√≥lo con los militares venezolanos, ser√° con todo un pueblo, ser√° con todo un pa√≠s dispuesto a defender la sagrada soberan√≠a de nuestro territorio.', 'Presentaci√≥n del Mensaje Anual a la Naci√≥n Asamblea Nacional, 13 de enero de 2006', 'img/chavez/049.png');
INSERT INTO frases_chavez VALUES (421, 'Tenemos que seguir sac√°ndonos el demonio de la infiltraci√≥n y la alienaci√≥n del imperialismo. Sus manuales y su doctrina no es nuestra; la doctrina de ellos es imperialista, la nuestra es libertadora. Ellos nacieron para la dominaci√≥n del mundo, nosotros nacimos para la libertad.', 'Conmemoraci√≥n de los 7 a√±os del gobierno del presidente Hugo Ch√°vez Fr√≠as,  Teatro Teresa Carre√±o, 2 de febrero de 2002', 'img/chavez/125.png');
INSERT INTO frases_chavez VALUES (431, '¬°Tendr√≠an que pasar por encima de los cad√°veres de millones de venezolanos para poder esclavizar de nuevo la patria libre de Bol√≠var!', 'D√≠a de la dignidad y la Rebeli√≥n Bolivariana, Avenida Bol√≠var de Caracas. 4 de febrero de 2006', NULL);
INSERT INTO frases_chavez VALUES (432, 'No le tenemos miedo al imperialismo norteamericano; y eso nos hace libres.', 'Al√≥ Presidente N¬∞ 246. Cuman√°, 5 de febrero de 2006', NULL);
INSERT INTO frases_chavez VALUES (437, 'El imperialismo norteamericano nos ve como seres inferiores, como su patio trasero y como sus esclavos. Pues no lo somos, ¬°somos libres y seremos libres!.', 'Declaraciones del presidente Ch√°vez luego de la reuni√≥n con el primer ministro de Granada, Keith Mitchell, Palacio de Miraflores, 16 de febrero de 2006', NULL);
INSERT INTO frases_chavez VALUES (444, 'As√≠ como defend√≠a a mis soldados cuando era responsable de mi tropa, hoy defiendo con fiereza la dignidad del gran escuadr√≥n que es el pueblo venezolano.', 'Al√≥ Presidente Nro. 249, Elorza, estado Apure; 19 de marzo de 2006', NULL);
INSERT INTO frases_chavez VALUES (445, 'Este es el siglo del fin del imperialismo norteamericano, estoy absolutamente seguro de que el imperio norteamericano no pasar√° de este siglo; ¬°a todo cochino le llega su s√°bado, a todo imperio le llega su siglo!', 'Inauguraci√≥n de La Central Hidroel√©ctrica Caruachi, estado Bol√≠var; 31 de marzo de 2006', NULL);
INSERT INTO frases_chavez VALUES (460, 'La tierra es la madre: es all√≠ donde est√°n todos los recursos para levantar a un pa√≠s, para la vida en com√∫n de un pueblo.', 'Al√≥ Presidente Nro. 249, Elorza, estado Apure; 19 de marzo de 2006', NULL);
INSERT INTO frases_chavez VALUES (434, 'Vamos a demostrarle una vez m√°s al imperio norteamericano y a la gente que le sirve, que nosotros somos soberanos y libres, y que vamos a seguir si√©ndolo. Pero para ello se requiere de mucha fuerza unitaria, conocimiento, moral, conciencia, entendimiento y acci√≥n conjunta de trabajo.', 'Primer Gabinete M√≥vil Comunal Teatro Teresa Carre√±o, 6 de febrero de 2006', NULL);
INSERT INTO frases_chavez VALUES (439, 'Levantemos el esp√≠ritu nacionalista y manteng√°monos alerta. Incrementemos la organizaci√≥n popular, la conciencia pol√≠tica, la unidad del pueblo y el trabajo para fortalecer a√∫n m√°s el pa√≠s y continuar resistiendo y derrotando las agresiones del imperialismo.', 'Acto con motivo de la entrega de pensiones de vejez, Palacio de Miraflores, 17 de febrero de 2006', NULL);
INSERT INTO frases_chavez VALUES (457, 'Ratifico mi admiraci√≥n por las mujeres venezolanas, por las mujeres que luchan, batallan e imprimen pasi√≥n y amor a todo lo que hacen; sobre todo por esa legi√≥n de mujeres que hoy batallan por la liberaci√≥n definitiva de Venezuela, de nuestra madre Patria, de la gran mujer que es Venezuela.', 'Primer Encuentro Nacional de la Red Popular de Usuarias del Banco de Desarrollo de la Mujer C√≠rculo Militar, 7 de marzo de 2006', 'img/chavez/126.png');
INSERT INTO frases_chavez VALUES (459, 'El d√≠a que las mujeres compartan con igual peso que los hombres la conducci√≥n de nuestros pueblos, el mundo empezar√° a enderezarse.', 'Conferimiento del Doctorado Honoris Causa de la Universidad Mayor de San Andr√©s, y medalla ‚ÄúMariscal Andr√©s de Santa Cruz‚Äù al presidente Ch√°vez, La Paz, 23 de enero de 2006', 'img/chavez/010.png');
INSERT INTO frases_chavez VALUES (458, 'Siempre he cre√≠do que uno de los grandes males del capitalismo es la exclusi√≥n a la mujer, la minimizaci√≥n del gran potencial que tiene la mujer para desempe√±arse en cualquier tarea, por m√°s dura y por m√°s exigente que sea.', 'Juramentaci√≥n de los ministros de Industrias Ligeras y Comercio, de Agricultura y Tierras, del Trabajo, para la Econom√≠a Popular, de Alimentaci√≥n, y del Despacho de la Presidencia de la Rep√∫blica, Palacio de Miraflores, 24 de febrero de 2006', 'img/chavez/007.png');
INSERT INTO frases_chavez VALUES (441, '¬°Pensamiento antiimperialista! ¬°Pensamiento de resistencia! ¬°Pensamiento nacionalista!: he all√≠ las fuertes corrientes del pensamiento militar venezolano.', 'Al√≥ Presidente N¬∫ 248, Municipio Acevedo, estado Miranda, 5 de marzo de 2006', 'img/chavez/049.png');
INSERT INTO frases_chavez VALUES (443, 'Con la fuerza de la verdad, que es la fuerza m√°s grande, junto al amor, la dignidad y la moral, venceremos los atropellos imperiales.', 'Juramentaci√≥n de nuevos embajadores, Palacio de Miraflores, 7 de marzo de 2006', 'img/chavez/107.png');
INSERT INTO frases_chavez VALUES (464, 'Un representante debe ser un eminente educador.', 'Participaci√≥n del inicio del nuevo per√≠odo de sesiones ordinarias 2006 y presentaci√≥n de la nueva Junta Directiva de la Asamblea Nacional al Poder Ejecutivo, Palacio Blanco, 6 de enero de 2006', NULL);
INSERT INTO frases_chavez VALUES (466, 'La uni√≥n de una gran hermandad nacional, el esp√≠ritu y el orgullo de ser venezolanos, nos impulsar√°n hacia la grandeza de la Patria.', 'Al√≥ Presidente N¬∫ 243 N√∫cleo de Desarrollo End√≥geno Jos√© F√©lix Ribas, estado Aragua, 8 de enero de 2006', NULL);
