INSERT INTO frases_chavez VALUES (468, 'Una de las grandes batallas de la Revoluci√≥n es la revoluci√≥n moral, para reinstalar los valores y la dignidad del ser humano.', 'Presentaci√≥n oficial de la Misi√≥n Negra Hip√≥lita, Teatro Teresa Carre√±o, 14 de enero de 2006', NULL);
INSERT INTO frases_chavez VALUES (469, 'El pueblo se ha convertido en el primer maestro de la Rep√∫blica.', 'Al√≥ Presidente N¬∫ 244, Palacio de Miraflores, 15 de enero de 2006', NULL);
INSERT INTO frases_chavez VALUES (470, 'S√≥lo unidos lograremos la Patria que so√±amos, la Patria que dejaremos a nuestros hijos.', 'Acto de Acuerdo Marco de Corresponsabilidad para la Transformaci√≥n Industrial, Sal√≥n Venezuela del C√≠rculo Militar, 20 de enero de 2006', NULL);
INSERT INTO frases_chavez VALUES (471, 'Educaci√≥n para la liberaci√≥n es lo que necesitamos.', 'Conferimiento del Doctorado Honoris Causa de la Universidad Mayor de San Andr√©s, y medalla ‚ÄúMariscal Andr√©s de Santa Cruz‚Äù al presidente Ch√°vez. La Paz, 23 de enero de 2006', NULL);
INSERT INTO frases_chavez VALUES (472, 'Llegamos aqu√≠ para hacer una revoluci√≥n o morir en el camino; no hay m√°s alternativa para nosotros.', 'Al√≥ Presidente N¬∫ 245 Parroquia Ant√≠mano, 29 de enero de 2006', NULL);
INSERT INTO frases_chavez VALUES (473, 'Cuando a una idea le llega su √©poca y anida en un espacio, se convierte en la fuerza m√°s poderosa que pueda existir. Creo que, sencillamente, a la idea de la transformaci√≥n, la vida y la Revoluci√≥n le lleg√≥ su √©poca y su espacio en Venezuela.', 'Conmemoraci√≥n de los siete a√±os del Gobierno del presidente Hugo Ch√°vez Fr√≠as. Teatro Teresa Carre√±o, 2 de febrero de 2002', NULL);
INSERT INTO frases_chavez VALUES (475, 'Siempre he pensado que el hombre individual muy poco pudiera hacer si no hay una circunstancia, si no hay otros hombres, otras mujeres; si no hay esa fuerza de un pueblo que a uno lo lleva, lo motiva, lo obliga y le aclara el camino.', 'Intervenci√≥n en la entrega del Premio Internacional de la UNESCO ‚ÄúJos√© Mart√≠‚Äù, La Habana, 3 de febrero de 2006', NULL);
