INSERT INTO frases_chavez VALUES (484, 'El Gobierno Revolucionario no descansar√°, no descansar√© yo en lo personal, hasta que no nos acerquemos a niveles superiores de felicidad posible.', 'Inauguraci√≥n del Centro M√©dico de Diagn√≥stico de Alta Tecnolog√≠a ‚Äú10 de Marzo‚Äù. La Guaira, 23 de marzo de 2006', NULL);
INSERT INTO frases_chavez VALUES (485, 'Mi vida es de ustedes, no me pertenece, es del pueblo venezolano; as√≠ estaremos abrazados hasta el fin de nuestros d√≠as, hasta el fin de nuestros tiempos.', 'Al√≥ Presidente N¬∞ 250, Valles del Tuy, 26 de marzo de 2006', NULL);
INSERT INTO frases_chavez VALUES (487, 'La uni√≥n de una gran hermandad nacional, el esp√≠ritu y el orgullo de ser venezolanos, nos impulsar√°n hacia la grandeza de la Patria.', 'Programa AL√ì PRESIDENTE N¬∫ 243, N√∫cleo de Desarrollo End√≥geno Jos√© F√©lix Ribas, Estado Aragua, 8 de enero de 2006', NULL);
INSERT INTO frases_chavez VALUES (490, 'Qu√© triste ser√≠a, ¬°por el amor de Dios!, que desperdiciemos esta maravillosa oportunidad que nos ha dado Dios, nuestra historia, el despertar de nuestros pueblos.', 'Firma de Acuerdos entre la Rep√∫blica Oriental del Uruguay y la Rep√∫blica Bolivariana de Venezuela, Palacio de Miraflores, 14 de marzo de 2006', NULL);
INSERT INTO frases_chavez VALUES (474, '¬°Implacables tenemos que ser con los traidores!', 'Desfile civicomilitar en ocasi√≥n del s√©ptimo aniversario del Gobierno Bolivariano, Patio de Honor de la Academia Militar, 2 de febrero de 2006', 'img/chavez/125.png');
INSERT INTO frases_chavez VALUES (491, 'Si el proyecto de aquellos hombres y aquellas mujeres se hubiese concretado hace 200 a√±os, sin duda que otra ser√≠a la historia de √©sta nuestra Am√©rica, de esta Patria Grande. Lo cual, adem√°s de ser una reflexi√≥n hist√≥rica, no deja de ser un compromiso que hoy latiguea el alma, que hoy compromete, que hoy impulsa.', 'Firma de Acuerdos entre la Rep√∫blica Oriental del Uruguay y la Rep√∫blica Bolivariana de Venezuela. Palacio de Miraflores, 14 de marzo de 2006', NULL);
INSERT INTO frases_chavez VALUES (492, 'Cada d√≠a debemos ser civiles y militares, m√°s revolucionarios. Hay que revolucionarse por dentro: en los valores espirituales y morales. Un verdadero revolucionario, por ejemplo, no anda buscando beneficio econ√≥mico alguno, ¬°no!: un verdadero revolucionario est√° pendiente del buen vivir del colectivo.', 'Activaci√≥n de la Planta Termoel√©ctrica ‚ÄúPedro Camejo‚Äù, Valencia, Edo. Carabobo; 21 de marzo de 2006', 'img/chavez/021.png');
INSERT INTO frases_chavez VALUES (463, 'El primer gran poder es el poder moral.', 'Hugo Rafael Ch√°vez Fr√≠as', NULL);
INSERT INTO frases_chavez VALUES (493, 'Lo primero que pretendieron hacer los golpistas del 2002 fue eliminar la Constituci√≥n, porque esta Constituci√≥n es como la Cruz de Cristo ante el demonio: el demonio es el neoliberalismo y el imperialismo, y esta Constituci√≥n soberana, hecha, discutida y aprobada por nuestro pueblo, le pone fin al proyecto neoliberal de entrega y de saqueo al pa√≠s.', 'Activaci√≥n de la Planta Termoel√©ctrica ‚ÄúPedro Camejo‚Äù, Valencia, Edo. Carabobo; 21 de marzo de 2006', 'img/chavez/073.png');
INSERT INTO frases_chavez VALUES (479, 'Somos soldados de la paz; luchamos por ella, por la igualdad y la justicia.', 'Develaci√≥n de la estatua del ciudadano Pedro Vel√°squez. Patio de Armas de la Academia Militar de Venezuela, 15 de febrero de 2006', 'img/chavez/021.png');
INSERT INTO frases_chavez VALUES (478, 'Fortalezcamos la salud mental, la salud corporal, la salud espiritual de la naci√≥n, a trav√©s del deporte y la cultura; eso es algo fundamental: un pueblo que no hace deporte est√° condenado al fracaso.', 'Inauguraci√≥n de la Universidad Iberoamericana del Deporte. San Carlos, 9 de febrero de 2006', 'img/chavez/061.png');
INSERT INTO frases_chavez VALUES (494, 'Tenemos que salvar la vida en este planeta. Debemos salvar al mundo de los desastres de la guerra, de los desastres de la miseria -que es una forma de guerra-, de los desastres de la explotaci√≥n de unas minor√≠as contra mayor√≠as.', 'Activaci√≥n de la Planta Termoel√©ctrica ‚ÄúPedro Camejo‚Äù, Valencia, Edo. Carabobo; 21 de marzo de 2006', NULL);
INSERT INTO frases_chavez VALUES (496, 'Nuestro liderazgo es colectivo y no depende de un hombre. Hay un l√≠der, por supuesto, pero hay una masa de l√≠deres entregados a este proyecto en alma, nervio y coraz√≥n.', 'Al√≥ Presidente N¬∞ 250 Valles del Tuy, 26 de marzo de 2006', NULL);
INSERT INTO frases_chavez VALUES (501, 'El poder del pueblo es el m√°s grande de los poderes, despu√©s del poder de Dios.', 'Inicio de la Misi√≥n Madres del Barrio y entrega de asignaciones econ√≥micas a amas de casa, Teatro Municipal de Caracas, 30 de marzo de 2006', NULL);
INSERT INTO frases_chavez VALUES (503, 'Estamos en un horizonte donde se aprecian las luces de un amanecer: estamos saliendo de la noche, est√° amaneciendo en esta tierra, es tiempo de resurrecci√≥n, es tiempo de un nuevo despertar, de un nuevo mundo, de una nueva patria.', 'Inicio de la Misi√≥n Madres del Barrio y entrega de asignaciones econ√≥micas a amas de casa, Teatro Municipal de Caracas, 30 de marzo de 2006', NULL);
INSERT INTO frases_chavez VALUES (510, 'No tengo nada contra los periodistas; soy cr√≠tico al manejo de los medios, y ustedes, periodistas, deber√≠an ser los primeros cr√≠ticos, en aras de la libertad de expresi√≥n y el balance comunicacional.', 'Activaci√≥n de la Planta Termoel√©ctrica ‚ÄúPedro Camejo‚Äù, Valencia, Edo. Carabobo; 21 de marzo de 2006', NULL);
INSERT INTO frases_chavez VALUES (512, 'Nos hab√≠an impuesto un proyecto ex√≥geno, subordinado a los poderes trasnacionales; ahora esto es un proyecto que se fundamenta en el poder nacional, a√∫n cuando trasciende los limites de nuestro territorio.', 'Al√≥ Presidente N¬∞ 250, Valles del Tuy, 26 de marzo de 2006', NULL);
INSERT INTO frases_chavez VALUES (516, 'Hay que ganar tiempo en la preparaci√≥n de la organizaci√≥n popular y la uni√≥n entre todos los factores revolucionarios.', 'Al√≥ Presidente N¬∞ 250, Valles del Tuy, 26 de marzo de 2006', NULL);
INSERT INTO frases_chavez VALUES (517, 'Quien pretenda llevar adelante un proyecto de transformaci√≥n, inevitablemente, m√°s temprano que tarde, chocar√° con el imperio norteamericano; el choque es necesario, as√≠ lo creo, porque el choque define.', 'Juramentaci√≥n del Ministro de Comunicaci√≥n e Informaci√≥n y de los Embajadores ante la ONU y ante la Rep√∫blica de Bolivia, Palacio de Miraflores, 28 de marzo de 2006', NULL);
INSERT INTO frases_chavez VALUES (518, 'Los pueblos romperemos el esquema impuesto en Naciones Unidas, para que haya de verdad naciones libres, hermanas y unidas, y no una dictadura contra la mayor√≠a de los pueblos del mundo.', 'Juramentaci√≥n del Ministro de Comunicaci√≥n e Informaci√≥n y de los Embajadores ante la ONU y ante la Rep√∫blica de Bolivia, Palacio de Miraflores, 28 de marzo de 2006', NULL);
INSERT INTO frases_chavez VALUES (520, 'Un pueblo ilustrado es instrumento hermoso de su propia liberaci√≥n.', 'Inicio de la Misi√≥n Madres del Barrio, Teatro Municipal de Caracas, 30 de marzo de 2006', NULL);
INSERT INTO frases_chavez VALUES (521, '¬°En Venezuela jam√°s se privatizar√°n los recursos energ√©ticos! El Estado tiene que garantizar a la Naci√≥n la propiedad de estos recursos vitales.', 'Inauguraci√≥n de La Central Hidroel√©ctrica Caruachi, estado Bol√≠var; 31 de marzo de 2006', NULL);
INSERT INTO frases_chavez VALUES (495, 'El socialismo es lo que propone Jes√∫s, el Cristo Redentor: vayamos iguales, como hermanos; que reine el amor entre nosotros y no el odio y la envidia; rechacemos el individualismo y sigamos el colectivismo; vivamos en comunidad, respetando los derechos de todos.', 'Inauguraci√≥n del Centro M√©dico de Diagn√≥stico de Alta Tecnolog√≠a ‚Äú10 de Marzo‚Äù, La Guaira, 23 de marzo de 2006', 'img/chavez/064.png');
INSERT INTO frases_chavez VALUES (499, 'Este tiempo de paz, como s√≠ntesis y culminaci√≥n, es el que ha estado forjando nuestro pueblo. Este tiempo de paz deber√≠a unirnos a todos los venezolanos, a todas las venezolanas, sobre todo para aislar definitivamente a las minor√≠as que a√∫n quieren que prevalezca el tiempo de la guerra, el odio y la destrucci√≥n.', 'Bienvenida a Su Excelencia Jorge Cardenal Urosa Savino, Maiquet√≠a, 30 de marzo de 2006', NULL);
