INSERT INTO frases_chavez VALUES (497, 'Venezuela necesita de la plena recuperaci√≥n del sentido eclesi√°stico, de lo que significa vivir en cristiandad; el genuino sentido eclesi√°stico est√° m√°s all√° del demonio del individualismo y los intereses ego√≠stas, obra en funci√≥n del fortalecimiento permanente de la comunidad, haciendo suya la opci√≥n preferencial por los pobres que nos ense√±√≥ Cristo.', 'Bienvenida al Cardenal Jorge Urosa Savino, Maiquet√≠a, 30 de marzo de 2006', NULL);
INSERT INTO frases_chavez VALUES (505, 'Pedimos a Dios por la paz. Cualquier diferencia que haya en el mundo entre los pa√≠ses, debemos solucionarla siempre por la v√≠a diplom√°tica.', 'Inauguraci√≥n de La Central Hidroel√©ctrica Caruachi, estado Bol√≠var; 31 de marzo de 2006', 'img/chavez/096.png');
INSERT INTO frases_chavez VALUES (506, 'Mi respeto a la Santa Iglesia Cat√≥lica, Apost√≥lica y Romana, de la cual soy miembro activo y batallador desde los tiempos de mi infancia.', 'Bienvenida a Su Excelencia Jorge Cardenal Urosa Savino, Maiquet√≠a, 30 de marzo de 2006', 'img/chavez/064.png');
INSERT INTO frases_chavez VALUES (523, 'No es incompatible un proyecto nacionalista, revolucionario, como el que en Venezuela est√° en marcha, y la presencia de dignas empresas internacionales y del sector privado nacional.', 'Firma de acuerdos para la migraci√≥n de los convenios operativos a las empresas mixtas. Palacio de Miraflores, 31 de marzo de 2006', NULL);
INSERT INTO frases_chavez VALUES (6, 'Rendimos tributo al pensamiento de Bol√≠var: Pensamiento antiimperialista, Pensamiento revolucionario, Pensamiento fundamental para construir la Patria Bolivariana.', 'Al√≥ Presidente N¬∫ 255. Ciudad Guayana, Estado Bol√≠var; 21 de mayo de 2006.', 'img/chavez/006.png');
INSERT INTO frases_chavez VALUES (461, 'El l√≠der verdadero es un gran educador c√≠vico, moral y pol√≠tico; un conductor.', 'Hugo Rafael Ch√°vez Fr√≠as', NULL);
