INSERT INTO frases_chavez VALUES (8, '¬°Nadie detendr√° la marcha victoriosa de la Patria de Sim√≥n Bol√≠var!', 'Hugo Rafael Ch√°vez Fr√≠as', 'img/chavez/008.png');
INSERT INTO frases_chavez VALUES (245, 'El ALBA es un mecanismo que est√° en marcha, y que est√° causando escozor en el imperio norteamericano y sus la cayos en el continente.', 'Hugo Rafael Ch√°vez Fr√≠as', NULL);
INSERT INTO frases_chavez VALUES (129, 'Como la nube a la tormenta, el capitalismo lleva dentro de s√≠ la muerte.', 'Hugo Rafael Ch√°vez Fr√≠as', 'img/chavez/129.png');
