INSERT INTO frases_chavez VALUES (133, 'El capitalismo lo que quiere es vender, y utiliza a la mujer como un objeto sexual, esa es una de las causas de la demolici√≥n de los valores.', 'Hugo Rafael Ch√°vez Fr√≠as', 'img/chavez/133.png');
INSERT INTO frases_chavez VALUES (137, 'S√≥lo a trav√©s del socialismo podremos vencer las r√©moras del ego√≠smo, el consumismo, el odio y la violencia.', 'Hugo Rafael Ch√°vez Fr√≠as', 'img/chavez/137.png');
INSERT INTO frases_chavez VALUES (299, 'Es fundamental para el proyecto nacional la ciencia y la tecnolog√≠a. Hay que aplicar la ciencia y la tecnolog√≠a en todas las cosas, por m√°s sencillas que sean.', 'Hugo Rafael Ch√°vez Fr√≠as', 'img/chavez/115.png');
INSERT INTO frases_chavez VALUES (302, 'La democracia de √©lites, representativa, es contrarrevolucionaria. Un Gobierno tomando decisiones encerrado en cuatro paredes, expropi√°ndole al pueblo su soberan√≠a, es contrarrevolucionario.', 'Hugo Rafael Ch√°vez Fr√≠as', NULL);
