INSERT INTO frases_chavez VALUES (396, 'Caracas-Brasilia-Buenos Aires: el ‚ÄòEje del Sur‚Äô, es la columna vertebral, uno de los ejes fundamentales del proceso de conformaci√≥n de la unidad de Suram√©rica.', 'Hugo Rafael Ch√°vez Fr√≠as', NULL);
INSERT INTO frases_chavez VALUES (398, 'La batalla del conocimiento, la batalla de la conciencia, la batalla de las ideas, debemos arreciarla; eso es fundamental para la liberaci√≥n, la integraci√≥n, la uni√≥n verdadera de nuestros pueblos; para la salvaci√≥n del mundo, incluso un deber.', 'Hugo Rafael Ch√°vez Fr√≠as', NULL);
