INSERT INTO frases_chavez VALUES (410, 'Muchas cosas podemos lograr en beneficio del desarrollo de nuestros pueblos; si alg√∫n continente tiene fuerza propia para dar ese gran salto hac√≠a un modelo propio de desarrollo social, humano, econ√≥mico, productivo, pol√≠tico, democr√°tico, es la Am√©rica Latina, incluyendo, por supuesto, al Caribe.', 'Seminario Internacional de Integraci√≥n Financiera en Am√©rica Latina y el Caribe, Banco Central de Venezuela, 24 de marzo de 2006', NULL);
INSERT INTO frases_chavez VALUES (522, 'Estamos dispuestos a acompa√±ar a los pueblos hermanos de Am√©rica Latina y el Caribe en su esfuerzo, porque s√≥lo nosotros, fronteras adentro, no lograremos nuestras metas; de ah√≠ nuestro empe√±o, nuestra voluntad suprema en continuar abriendo los caminos a una verdadera integraci√≥n.', 'Inauguraci√≥n de La Central Hidroel√©ctrica Caruachi, estado Bol√≠var; 31 de marzo de 2006', NULL);
INSERT INTO frases_chavez VALUES (524, 'Ser rico es malo, es inhumano. As√≠ lo digo y condeno a los ricos.', 'Abril de 2005 a empresarios venezolanos.', NULL);
