INSERT INTO frases_chavez VALUES (527, 'Por Cristo, el m√°s grande socialista de la historia, por todos los dolores, por todos los amores, por todas las esperanzas que har√© cumplir con los mandatos supremos de esta maravillosa Constituci√≥n aun a costa de mi propia vida. Patria, socialismo o muerte.', 'Enero de  2007, toma de posesi√≥n de su nuevo mandato constitucional.', NULL);
INSERT INTO frases_chavez VALUES (528, 'T√∫ [Fidel Castro], forjador de historia, maestro, yo lo digo sin complejos, t√∫ eres padre de los revolucionarios de este continente, tu eres el padre nuestro.', 'Octubre de  2007 al cdte. Fidel Castro', NULL);
INSERT INTO frases_chavez VALUES (529, 'Tenemos 500 a√±os aqu√≠ y nunca nos callaremos, mucho menos ante un monarca.', '10 de noviembre de 2007, tras el "¬øPor qu√© no te callas?" que le dijo el rey de Espa√±a.', NULL);
INSERT INTO frases_chavez VALUES (530, 'V√°yanse al carajo yanquis de mie*** que aqu√≠ hay un pueblo digno. V√°yanse al carajo cien veces. Aqu√≠ estamos los hijos de Bol√≠var, los hijos de Guaicaipuro, los hijos de T√∫pac Amaru y estamos resueltos a ser libres.', 'Septiembre de 2008 al momento de expulsar al embajador de Estados Unidos.', NULL);
INSERT INTO frases_chavez VALUES (531, 'El Papa no es ning√∫n embajador de Cristo en la tierra, como ellos dicen. ¬°Por el amor de Dios! ¬øQu√© cosa es esa? Embajador de Cristo. Cristo no necesita embajador, Cristo est√° en el pueblo.', 'Julio de 2010 al Papa Benedicto XVI.', NULL);
INSERT INTO frases_chavez VALUES (10, 'El Che Guevara est√° siempre con nosotros, vivo en el recuerdo y en el alma de nuestros pueblos.', 'Hugo Rafael Ch√°vez Fr√≠as', 'img/chavez/010.png');
INSERT INTO frases_chavez VALUES (11, '¬°Es mentira la tesis del descubrimiento de Am√©rica! ¬°Fue realmente una colonizaci√≥n y una invasi√≥n que arras√≥ con nuestra civilizaci√≥n aborigen!', 'Hugo Rafael Ch√°vez Fr√≠as', 'img/chavez/011.png');
INSERT INTO frases_chavez VALUES (533, '¬°Hasta la vida siempre! ¬°Viviremos y Venceremos!', '10 de Diciembre de 2012. Al partir a su √∫ltimo viaje a Cuba.', NULL);
INSERT INTO frases_chavez VALUES (7, '¬øQui√©n convoc√≥ el Congreso Anficti√≥nico? Bol√≠var. ¬øDesde d√≥nde lo convoc√≥? Desde Lima. ¬øCu√°ndo lo convoc√≥? Dos d√≠as antes de la Batalla de Ayacucho. Fue como una premonici√≥n de Bol√≠var, porque Bol√≠var ten√≠a el don de la gran estrategia.', 'Conferencia de prensa del presidente Ch√°vez con medios nacionales y corresponsales, en el marco de los acuerdos del ALBA. Palacio de Miraflores, 24 de mayo de 2006.', 'img/chavez/007.png');
INSERT INTO frases_chavez VALUES (9, 'En el 2026, a doscientos a√±os del Congreso de Panam√°, debe ser una realidad la integraci√≥n plena de nuestra Am√©rica, la conformaci√≥n del bloque pol√≠tico, libre y de iguales. ¬øEs posible? ¬°Claro que es posible!', 'Firma de acuerdos, convenios y memorandos de entendimiento en el marco del ALBA y el TCP. Palacio de Gobierno de La Paz, Bolivia; 26 de mayo de 2006.', 'img/chavez/009.png');
INSERT INTO frases_chavez VALUES (14, 'Gloria eterna a Antonio Jos√© de Sucre, el Gran Mariscal de Ayacucho. Te lloramos, pero te reivindicamos; te lloramos, pero elevamos tu antorcha, que hoy est√° m√°s viva que nunca.', 'Al√≥ Presidente N¬∞ 257. Parque Nacional El √Åvila, 4 de junio de 2006.', 'img/chavez/014.png');
INSERT INTO frases_chavez VALUES (16, 'El socialismo robinsoniano es una de las m√°s poderosas ra√≠ces del nuevo socialismo del siglo XXI que hemos comenzado a construir en Venezuela.', 'Entrega de titularidad a docentes del estado Zulia. Plaza de Toros Monumental de Maracaibo, 10 de junio de 2006.', 'img/chavez/016.png');
INSERT INTO frases_chavez VALUES (17, 'Debemos dedicarnos por entero en mente, cuerpo, alma y esp√≠ritu, para que la historia que estamos escribiendo sea distinta.', 'Al√≥ Presidente N¬∫ 258. Villa Bruzual, estado Portuguesa; 11 de junio de 2006.', 'img/chavez/017.png');
INSERT INTO frases_chavez VALUES (18, '¬°Con nosotros no van a poder! ¬°En Venezuela est√°n las cenizas de Sim√≥n Bol√≠var, las cenizas de nuestros abuelos, las cenizas de Guaicaipuro! ¬°Tendr√≠an que aniquilarnos a todos nosotros para adue√±arse de esta tierra!', 'Entrega de fusiles de asalto Kalashnikov AK-103. Patio de Honor del Ministerio de la Defensa. 14 de junio de 2006', 'img/chavez/018.png');
INSERT INTO frases_chavez VALUES (22, '¬°Que la Revoluci√≥n se siembre hasta lo m√°s profundo de la tierra venezolana y en la conciencia de los venezolanos!, ¬°pueblo revolucionario!, ¬°pueblo heroico!, ¬°pueblo grande!', 'Alo Presidente N¬∞ 251. Hato San Pablo Pae√±o, estado Apure; 2 de abril de 2006.', 'img/chavez/022.png');
INSERT INTO frases_chavez VALUES (24, 'Estamos abriendo los caminos iniciales de la primera etapa de una Revoluci√≥n que trascender√° este siglo, para bien de Venezuela y para hacer realidad un mundo distinto, un mundo mejor.', 'Declaraciones del presidente Ch√°vez durante la inauguraci√≥n de Aldeas Universitarias 5 de abril de 2006', 'img/chavez/024.png');
INSERT INTO frases_chavez VALUES (25, 'Toda revoluci√≥n requiere nacimientos y renacimientos, muerte y parto; parto permanente de lo nuevo, muerte permanente de lo corrupto y podrido.', 'Al√≥ Presidente N¬∞ 252. Campo de Carabobo, 9 de abril de 2006.', 'img/chavez/025.png');
INSERT INTO frases_chavez VALUES (26, '¬°Quien de verdad est√© conmigo tiene que ser capaz de morir por el pueblo y por la Patria!', 'Al√≥ Presidente N¬∞ 252. Campo de Carabobo, 9 de abril de 2006.', 'img/chavez/026.png');
INSERT INTO frases_chavez VALUES (28, 'Las revoluciones logran cosas que parec√≠an imposibles.', 'Primer Encuentro Nacional de Estudiantes de la Universidad Bolivariana de Venezuela. Punto Fijo, 18 de abril de 2006.', 'img/chavez/028.png');
INSERT INTO frases_chavez VALUES (30, 'La Revoluci√≥n Bolivariana es sobre todo humanista, yo siempre digo ‚Äòcristiana‚Äô, porque Cristo vino a ense√±arnos esto: la humanidad y la justicia.', 'Al√≥ Presidente N¬∫ 253. El Tigre, estado Anzo√°tegui; 23 de abril de 2006.', 'img/chavez/030.png');
INSERT INTO frases_chavez VALUES (32, 'Esta Revoluci√≥n tiene que ser cada d√≠a m√°s humana, y dentro de lo humano, cada d√≠a m√°s cristiana. Am√°ndonos los unos a los otros lograremos tener Patria libre y grande y hacer una Revoluci√≥n profunda.', 'Rueda de prensa entre el presidente Hugo Ch√°vez y el presidente electo de la Rep√∫blica de Hait√≠, Ren√© Preval. Palacio de Miraflores, 24 de abril de 2006.', 'img/chavez/032.png');
INSERT INTO frases_chavez VALUES (12, 'Los pueblos de la Am√©rica India estamos llamados a reencontrarnos con nuestras ra√≠ces para reconstituir nuestra propia alma, nuestra propia esencia, y lanzarnos hacia un futuro en igualdad y libertad.', 'Hugo Rafael Ch√°vez Fr√≠as', 'img/chavez/012.png');
INSERT INTO frases_chavez VALUES (19, '¬°Esta Revoluci√≥n no tiene derecho a fracasar!', 'Hugo Rafael Ch√°vez Fr√≠as', 'img/chavez/019.png');
INSERT INTO frases_chavez VALUES (532, 'M√°s f√°cil ser√° que un burro pase por el ojo de una aguja a que esta oposici√≥n le gane a Ch√°vez unas elecciones.', 'Octubre de 2011, sobre las elecciones presidenciales en Venezuela.', 'img/chavez/109.png');
INSERT INTO frases_chavez VALUES (39, 'Hagamos una batalla por la justicia y vendr√° la paz entre nosotros.', 'Hato San Pablo Pae√±o, estado Apure; 2 de abril de 2006.', 'img/chavez/039.png');
INSERT INTO frases_chavez VALUES (41, 'Dentro del proyecto nacional de desarrollo, necesitamos una pol√≠tica cient√≠fica nacional, y estamos desarroll√°ndola; de all√≠ la Misi√≥n Ciencia y las Aldeas Universitarias.', 'Inauguraci√≥n de Aldea Universitarias Turmero, estado Aragua 4 de abril de 2006.', 'img/chavez/041.png');
INSERT INTO frases_chavez VALUES (42, 'Debemos impulsar un gran movimiento estudiantil, protestatario, consciente, con nuevas formas de organizaci√≥n adecuadas al siglo XXI, de verdadera democracia, que rompa con el enclaustramiento para alcanzar la verdadera autonom√≠a universitaria.', 'Primer Encuentro Nacional de Estudiantes de la Universidad Bolivariana de Venezuela. Punto Fijo, 18 de abril de 2006.', 'img/chavez/042.png');
INSERT INTO frases_chavez VALUES (43, 'En Venezuela, m√°s pronto que tarde, no habr√° un solo ni√±o en la calle, ni un indigente, ni una familia abandonada. ¬°Eso debe ser objetivo supremo de nuestra Revoluci√≥n!', 'Acto con motivo del III Aniversario de la Misi√≥n Barrio Adentro. Teatro Municipal de Caracas, 21 de abril de 2006.', 'img/chavez/043.png');
INSERT INTO frases_chavez VALUES (46, 'Queremos que el petr√≥leo venezolano sirva para la paz y para el amor, para sacar de la miseria a tanta gente.', 'Al√≥ Presidente N¬∞ 253. Campo Oficina, municipio Sim√≥n Rodr√≠guez, El Tigre, estado Anzo√°tegui; 23 de abril de 2006.', 'img/chavez/046.png');
INSERT INTO frases_chavez VALUES (47, '¬°Quiero al pueblo de los Estados Unidos igual que quiero al pueblo venezolano!... creo que tenemos el mismo destino.', 'Conversatorio con autoridades y representantes del programa de combustible para calefacci√≥n a bajo costo para los pobres en Estados Unidos. Palacio de Miraflores; 24 de abril de 2006.', 'img/chavez/047.png');
INSERT INTO frases_chavez VALUES (49, 'A la juventud venezolana: iluminen el camino de este pueblo y sean sal para acabar con la corrupci√≥n moral, con la corrupci√≥n material y con la corrupci√≥n de los valores.', 'Entrega de becas y relanzamiento de la Fundaci√≥n Gran Mariscal de Ayacucho. Teatro Teresa Carre√±o, 2 de mayo de 2006.', 'img/chavez/049.png');
INSERT INTO frases_chavez VALUES (51, '¬°No me cabe en el pecho el amor que siento por este pueblo! ¬°Me desborda de pasi√≥n y de fuerza!', 'Primer Encuentro Nacional de Cajas Rurales 2006. Complejo de Eventos Bellas Artes, estado Lara. 5 de mayo de 2006.', 'img/chavez/051.png');
INSERT INTO frases_chavez VALUES (52, 'Hay que recuperar los valores de la solidaridad y el amor entre nosotros, y no la envidia, el odio y el individualismo.', 'Inauguraci√≥n de la Fase I del Acueducto Chirgua-El Cercado. Estaci√≥n de Bombeo El Vidrio, estado Lara. 5 de mayo de 2006.', 'img/chavez/052.png');
INSERT INTO frases_chavez VALUES (54, 'Tengo fe en el buen juicio y la conciencia del pueblo. Al pueblo lo pueden enga√±ar a veces a trav√©s de grandes manipulaciones, pero cuando despierta se convierte en el m√°s grande sabio que puede haber entre cielo y tierra.', 'II Gabinete M√≥vil Comunal. Barquisimeto, estado Lara. 6 de mayo de 2006.', 'img/chavez/054.png');
INSERT INTO frases_chavez VALUES (55, 'La revoluci√≥n verdadera no es la de los fusiles sino la de las ideas, la del estudio; ¬°profundicemos la revoluci√≥n moral!, ¬°avancemos en la revoluci√≥n social para que todos seamos iguales!, ¬°potenciemos la revoluci√≥n econ√≥mica para que todos podamos vivir dignamente!', 'Inauguraci√≥n del Liceo Bolivariano Jorge Rodr√≠guez, Avenida Jacinto Lara, El Cercado, Barquisimeto, estado Lara. 6 de mayo de 2006.', 'img/chavez/055.png');
INSERT INTO frases_chavez VALUES (56, 'Hemos pedido que se estudien a fondo las razones del incremento de los precios del petr√≥leo, y m√°s all√° de los precios, que veamos las causas de lo que puede configurar una crisis peligrosa para el mundo: la crisis energ√©tica.', 'Declaraciones del presidente Ch√°vez a la salida de la reuni√≥n con el jefe de Gobierno de Austria, Heinz Fischer. Viena, Austria; 13 de mayo de 2006.', 'img/chavez/056.png');
INSERT INTO frases_chavez VALUES (58, '¬°No podemos fallarle al mundo! De lo que pase en Venezuela, del √©xito de nuestra Revoluci√≥n puede depender, en el futuro, la salvaci√≥n de este planeta.', 'Inauguraci√≥n de la Unidad Materno Infantil ‚ÄúDr. Oswaldo Ismael Brito. Tucupita, estado Delta Amacuro; 20 de mayo de 2006.', 'img/chavez/058.png');
