INSERT INTO frases_chavez VALUES (69, 'En Venezuela se acab√≥ la falsa democracia de las √©lites, tenemos que encerrarla de finitivamente y terminar de construir la democracia socialista, participativa, protag√≥nica.', 'II Gabinete M√≥vil Comunal. Barquisimeto, estado Lara; 06 de mayo de 2006.', 'img/chavez/069.png');
INSERT INTO frases_chavez VALUES (70, 'Lo de ‚ÄòPresidente‚Äô a m√≠, en verdad, no me importa mucho, lo que s√≠ me importa es nunca perder mis ra√≠ces, nunca perder el contacto directo con ustedes, sino navegar en el alma del pueblo al que pertenezco.', 'Inauguraci√≥n del Liceo Bolivariano Jorge Rodr√≠guez, Avenida Jacinto Lara, El Cercado, Barquisimeto, estado Lara. 6 de mayo de 2006.', 'img/chavez/070.png');
INSERT INTO frases_chavez VALUES (71, 'No defendemos intereses mezquinos, defendemos, con nuestra vida, el inter√©s del pueblo y de la Rep√∫blica, y de ah√≠ no nos sacar√° nada, ni nadie.', 'Al√≥ Presidente N¬∞ 254. Barquisimeto, estado Lara; 7 de mayo de 2006.', 'img/chavez/071.png');
INSERT INTO frases_chavez VALUES (72, 'La Revoluci√≥n que el pueblo venezolano est√° impulsando busca, sobre todo, darle igualdad al pa√≠s, igualdad con libertad.', 'Entrevista al Presidente Ch√°vez por el periodista Enzo Micalizzi, del Canal RAI-2 de Italia. 10 de mayo de 2006', 'img/chavez/072.png');
INSERT INTO frases_chavez VALUES (74, 'Estamos empe√±ados en continuar por este rumbo en lo social, en lo pol√≠tico, una democracia plena, cada d√≠a m√°s vigorosa, participativa y protag√≥nica; en lo econ√≥mico, un proyecto para dar un nuevo modelo que sea productivo, diversificado y moderno; para alcanzar una econom√≠a al servicio de la gente y no al servicio de minor√≠as.', 'Reuni√≥n con empresarios del Reino Unido. Canning House, Londres; 15 de mayo de 2006.', 'img/chavez/074.png');
INSERT INTO frases_chavez VALUES (76, 'Pido, como pedir√≠a por mi vida, y creo que me importa m√°s esto que mi propia vida, que la Revoluci√≥n Bolivariana sea aut√©ntica, que no sea una mentira como tantas ha habido, que no sea otro fracaso. ¬°Eso me importa un mill√≥n de veces m√°s que mi propia vida!', 'Inauguraci√≥n de la Unidad Materno Infantil ‚ÄúDr. Oswaldo Ismael Brito. Tucupita, estado Delta Amacuro; 20 de mayo de 2006.', 'img/chavez/076.png');
