INSERT INTO frases_chavez VALUES (101, 'Se acabaron aquellos carnavales electorales donde la gente iba a votar sin saber por qu√© votaba. ¬°No!, cada venezolano que vote por Hugo Ch√°vez el pr√≥ximo diciembre, debe votar por la Revoluci√≥n y la construcci√≥n del socialismo en Venezuela.', 'II Gabinete M√≥vil Comunal. Barquisimeto, estado Lara. 6 de mayo de 2006.', 'img/chavez/101.png');
