INSERT INTO frases_chavez VALUES (104, 'Los revolucionarios, los socialistas, los que est√©n convencidos de que hay que hacer transformaciones profundas en Venezuela, deben votar por la Revoluci√≥n Bolivariana.', 'Inauguraci√≥n de la Unidad Materno Infantil ‚ÄúDr. Oswaldo Ismael Brito. Tucupita, estado Delta Amacuro; 20 de mayo de 2006.', 'img/chavez/104.png');
