INSERT INTO frases_chavez VALUES (106, 'La pol√≠tica, la estrategia y los recursos, son los tres elementos fundamentales para atender los problemas m√°s urgentes y apremiantes de nuestros pueblos.', 'Conferencia de prensa del presidente Ch√°vez. Residencia del Embajador de Venezuela, Quito, Ecuador. 30 de mayo de 2006.', 'img/chavez/106.png');
