INSERT INTO frases_chavez VALUES (150, 'Hasta el m√°s lejano rinc√≥n debe llegar la mano de la justicia para poner orden en la propiedad de la tierra; ¬°tierra para los campesinos!, ¬°tierra para el que la trabaje!, ¬°tierra para los verdaderos productores!, ¬°justicia para el campo!', 'Hugo Rafael Ch√°vez Fr√≠as', NULL);
