INSERT INTO frases_chavez VALUES (160, 'Un superior m√°ximo, despu√©s de Dios, lo conforman ustedes mismos como pueblo, y yo siempre estar√© obedeci√©ndoles.', 'Hugo Rafael Ch√°vez Fr√≠as', 'img/chavez/092.png');
INSERT INTO frases_chavez VALUES (152, 'La aldea universitaria no debe tener muros que la separen del pueblo, la aldea universitaria es del pueblo y para el pueblo.', 'Hugo Rafael Ch√°vez Fr√≠as', 'img/chavez/004.png');
INSERT INTO frases_chavez VALUES (246, 'En Am√©rica Latina van a seguir llegando nuevos liderazgos, porque est√°n sustentados en el clamor de las mayor√≠as; es la voz de la naci√≥n la que se est√° expresando y buscando nuevos caminos.', 'Hugo Rafael Ch√°vez Fr√≠as', 'img/chavez/058.png');
