INSERT INTO frases_chavez VALUES (169, 'Los Consejos Comunales constituyen el proyecto que dar√° el paso hist√≥rico para convertir la vieja democracia representativa, sin pueblo, en una democracia verdadera, a trav√©s de la cual marchemos hacia el socialismo.', 'Hugo Rafael Ch√°vez Fr√≠as', NULL);
INSERT INTO frases_chavez VALUES (171, 'Cada d√≠a deben ser gobiernos populares los que deben consolidarse en Venezuela.', 'Hugo Rafael Ch√°vez Fr√≠as', NULL);
