INSERT INTO frases_chavez VALUES (203, 'Algunas televisoras emiten mensajes dirigidos al odio, al irrespeto a las instituciones, a la duda de unos a otros, a los rumores. Guerra sicol√≥gica para dividir a la Naci√≥n, para debilitarla y para destruirla. ¬°Ese es un plan imperialista! ¬°Son caballos de Troya en nuestras propias narices!', 'Hugo Rafael Ch√°vez Fr√≠as', NULL);
