INSERT INTO frases_chavez VALUES (216, 'Tenemos varios a√±os proponiendo l√≠neas estrat√©gicas de cooperaci√≥n, solidaridad y complementariedad en Suram√©rica, porque tenemos una conciencia hist√≥rica acerca de la importancia de la unidad.', 'Hugo Rafael Ch√°vez Fr√≠as', NULL);
