INSERT INTO frases_chavez VALUES (222, 'Nuestro rumbo no est√° en el Norte, insistimos, nuestro rumbo est√° en el Sur; tenemos que terminar de liberarnos de esos viejos mecanismos para apuntalar la integraci√≥n del Sur.', 'Hugo Rafael Ch√°vez Fr√≠as', NULL);
INSERT INTO frases_chavez VALUES (226, 'Ning√∫n pa√≠s mejor ubicado que Venezuela, desde el punto de vista geogr√°fico, geopol√≠tico y econ√≥mico, para cumplir un papel como de engranaje y ayudar a acelerar la integraci√≥n de toda Suram√©rica.', 'Hugo Rafael Ch√°vez Fr√≠as', NULL);
INSERT INTO frases_chavez VALUES (227, 'Suram√©rica siempre se me ha parecido a una bella mujer bailando en un pie.', 'Hugo Rafael Ch√°vez Fr√≠as', NULL);
