INSERT INTO frases_chavez VALUES (238, 'Tenemos siete a√±os proponiendo un cambio de enfoque. Lleg√≥ el momento de comenzar a liberarnos de las cadenas del pasado, de reconocer que hemos heredado mecanismos injustos de comercio, acuerdos y tratados.', 'Hugo Rafael Ch√°vez Fr√≠as', NULL);
INSERT INTO frases_chavez VALUES (243, 'En la Patria grande hay una emergencia de corrientes populares progresistas, corrientes revolucionarias, corrientes de izquierda que claman por un cambio.', 'Hugo Rafael Ch√°vez Fr√≠as', NULL);
