INSERT INTO frases_chavez VALUES (257, 'Tenemos que terminar de borrar las f√≥rmulas extra√±as a nosotros mismos y buscar los c√≥digos de nuestro pensamiento m√°s antiguo.', 'Hugo Rafael Ch√°vez Fr√≠as', NULL);
