INSERT INTO frases_chavez VALUES (381, 'Hay que insistir en la creaci√≥n de un nuevo modelo socialista, indoamericano, martiano, bolivariano, criollo, nuestro; un camino distinto a la destrucci√≥n del planeta.', 'Hugo Rafael Ch√°vez Fr√≠as', NULL);
INSERT INTO frases_chavez VALUES (385, 'Vamos caminando hacia el socialismo, para dejar atr√°s vel modelo perverso del capitalismo, que todo lo privatiza y a todo le quita el alma.', 'Hugo Rafael Ch√°vez Fr√≠as', NULL);
INSERT INTO frases_chavez VALUES (391, 'El Gobierno venezolano no regala, el Gobierno venezolano es integracionista; lo que aqu√≠ antes se llevaban y se robaban las √©lites y el imperio norteamericano, ahora lo hemos recuperado, y parte de ello lo compartimos con pueblos hermanos.', 'Hugo Rafael Ch√°vez Fr√≠as', NULL);
INSERT INTO frases_chavez VALUES (371, 'Cada Liceo Bolivariano debe constituirse en un polo, en un n√∫cleo de desarrollo end√≥geno que impacte el desarrollo social de las comunidades; debe ser un motor para el desarrollo social, la organizaci√≥n comunitaria y algo muy importante: la educaci√≥n para el trabajo.', 'Hugo Rafael Ch√°vez Fr√≠as', NULL);
INSERT INTO frases_chavez VALUES (405, 'Vean lo que tiene Suram√©rica: el primer reservorio de petr√≥leo del mundo, uno de los m√°s grandes de gas y el primer reservorio de agua del planeta. No es utop√≠a lo que decimos: √©sta es la cuna de un proyecto que bien puede alterar el curso de la historia.', 'Hugo Rafael Ch√°vez Fr√≠as', NULL);
INSERT INTO frases_chavez VALUES (408, 'Los verdaderos patriotas debemos entender que para que haya un continente verdaderamente libre, requerimos del desarrollo y de la unidad con todos nuestros pueblos.', 'Hugo Rafael Ch√°vez Fr√≠as', NULL);
INSERT INTO frases_chavez VALUES (419, 'Podemos salvar a los pueblos de este mundo, y para ello es imprescindible contar con el pueblo de Estados Unidos, con la conciencia del pueblo de Estados Unidos, con la resurrecci√≥n del pueblo de Estados Unidos.', 'Hugo Rafael Ch√°vez Fr√≠as', NULL);
INSERT INTO frases_chavez VALUES (423, 'Creo que este siglo XXI que comienza, es el siglo que marcar√° el fin del imperio norteamericano.', 'Hugo Rafael Ch√°vez Fr√≠as', NULL);
INSERT INTO frases_chavez VALUES (425, 'Estamos enfrentando, compatriotas, al imperio m√°s poderoso, al imperio m√°s inmoral, al imperio m√°s c√≠nico, al imperio m√°s asesino que haya existido en toda la historia de este planeta.', 'Hugo Rafael Ch√°vez Fr√≠as', NULL);
INSERT INTO frases_chavez VALUES (426, '¬°Este debe ser el siglo del fin del imperio genocida de Estados Unidos!', 'Hugo Rafael Ch√°vez Fr√≠as', NULL);
INSERT INTO frases_chavez VALUES (428, 'El enemigo de los pueblos de Am√©rica Latina, enemigo de todos los proyectos libertarios de Am√©rica Latina, enemigo de las esperanzas de los pueblos de Am√©rica Latina y del Caribe; es la elite imperialista de los Estados Unidos.', 'Hugo Rafael Ch√°vez Fr√≠as', NULL);
INSERT INTO frases_chavez VALUES (433, 'Al imperio no hay que subestimarlo, pero tampoco hay que temerle.', 'Hugo Rafael Ch√°vez Fr√≠as', NULL);
INSERT INTO frases_chavez VALUES (435, 'El imperialismo norteamericano lleva varios a√±os tratando de aislarnos, pero han fracasado y fracasar√°n porque no tienen raz√≥n ni moral alguna, y porque cada d√≠a los pueblos conocen mejor la verdad sobre Venezuela.', 'Hugo Rafael Ch√°vez Fr√≠as', NULL);
INSERT INTO frases_chavez VALUES (436, 'Seguiremos nuestro rumbo: construyendo nuestro pa√≠s e impulsando nuestro proyecto internacional de un mundo multipolar donde se respete la igualdad entre los estados.', 'Hugo Rafael Ch√°vez Fr√≠as', NULL);
INSERT INTO frases_chavez VALUES (438, 'Los gobiernos de la IV Rep√∫blica estaban subordinados al imperio norteamericano, eran sus peones. Hoy nosotros no somos peones, somos due√±os de nuestro propio destino, ¬°somos libres!', 'Hugo Rafael Ch√°vez Fr√≠as', NULL);
INSERT INTO frases_chavez VALUES (440, 'Nunca habr√° un ‚Äòfrente contra Ch√°vez‚Äô, porque los pueblos saben que la amenaza a este peque√±o mundo nuestro no se llama Hugo Ch√°vez, sino que precisamente la representa el gobierno de Estados Unidos.', 'Hugo Rafael Ch√°vez Fr√≠as', NULL);
INSERT INTO frases_chavez VALUES (442, '¬°Vaya qu√© democracia tienen en Estados Unidos! Pretenden presentarse ante el mundo como los campeones de la democracia, cuando lo que realmente existe es una dictadura de poderos√≠simos grupos econ√≥micos que tienen una marioneta llamada George W. Bush.', 'Hugo Rafael Ch√°vez Fr√≠as', NULL);
INSERT INTO frases_chavez VALUES (462, 'Un gobernante, un representante de cualquier nivel, no puede andar sin un libro bajo el brazo.', 'Hugo Rafael Ch√°vez Fr√≠as', NULL);
INSERT INTO frases_chavez VALUES (465, 'Una cosa es el error y otra cosa es el enga√±o: nosotros bien podemos equivocarnos, pero mal podemos enga√±arnos.', 'Hugo Rafael Ch√°vez Fr√≠as', NULL);
INSERT INTO frases_chavez VALUES (450, 'Luchamos con fervor por una sociedad socialista que signifique la liberaci√≥n plena de la mujer como g√©nero, como actor social transformador del mundo.', 'Hugo Rafael Ch√°vez Fr√≠as', 'img/chavez/126.png');
INSERT INTO frases_chavez VALUES (446, 'Siempre he cre√≠do que uno de los grandes males del capitalismo es la exclusi√≥n a la mujer, la minimizaci√≥n del gran potencial que tiene la mujer para desempe√±arse en cualquier tarea, por m√°s dura y por m√°s exigente que sea.', 'Hugo Rafael Ch√°vez Fr√≠as', 'img/chavez/124.png');
INSERT INTO frases_chavez VALUES (449, 'Un equipo de Gobierno debe estar cada d√≠a m√°s acompa√±ado de mujeres; ellas siempre ponen un extra, una dosis de amor, fuerza, pasi√≥n, coraje, entrega; elementos intr√≠nsecos de la mujer.', 'Hugo Rafael Ch√°vez Fr√≠as', 'img/chavez/032.png');
INSERT INTO frases_chavez VALUES (451, 'No se podr√° salvar el mundo si no logramos la plena igualdad del g√©nero y la participaci√≥n de la mujer como actor fundamental de las distintas luchas que libramos.', 'Hugo Rafael Ch√°vez Fr√≠as', 'img/chavez/010.png');
INSERT INTO frases_chavez VALUES (453, 'Invito a las mujeres venezolanas a incorporarse en masa a la reserva militar, para defender la soberan√≠a de la Patria ante cualquier amenaza imperialista.', 'Hugo Rafael Ch√°vez Fr√≠as', 'img/chavez/004.png');
INSERT INTO frases_chavez VALUES (454, 'Las mujeres venezolanas son las protagonistas, l√≠deres de las misiones bolivarianas.', 'Hugo Rafael Ch√°vez Fr√≠as', 'img/chavez/111.png');
INSERT INTO frases_chavez VALUES (456, 'Al mundo debemos salvarlo, pero al mundo no podemos salvarlo s√≥lo los hombres. ¬°Sin participaci√≥n de las mujeres no hay mundo posible!; ¬°sin ellas no habr√° paz, libertad ni futuro posible!', 'Hugo Rafael Ch√°vez Fr√≠as', 'img/chavez/038.png');
INSERT INTO frases_chavez VALUES (476, 'La Patria necesita patriotas; ya hemos tenido suficientes traidores.', 'Hugo Rafael Ch√°vez Fr√≠as', 'img/chavez/125.png');
INSERT INTO frases_chavez VALUES (477, 'El venezolano, el revolucionario, es del tama√±o del compromiso de la historia.', 'Hugo Rafael Ch√°vez Fr√≠as', NULL);
INSERT INTO frases_chavez VALUES (409, 'Am√©rica Latina es impulsada por la conciencia de sus pueblos hacia una direcci√≥n alternativa con las variantes correspondientes, naturales, l√≥gicas y absolutamente necesarias, en base a nuestras particularidades, nuestras fortalezas y nuestras posibilidades.', 'Hugo Rafael Ch√°vez Fr√≠as', NULL);
INSERT INTO frases_chavez VALUES (481, 'No habr√° verdadera Revoluci√≥n si no tocamos la fibra moral de la naci√≥n, para elevarla hasta lo m√°s sublime del ser humano.', 'Hugo Rafael Ch√°vez Fr√≠as', NULL);
INSERT INTO frases_chavez VALUES (482, 'Al pueblo organizado, capacitado: hagan el trabajo de todos los d√≠as y contar√°n con todo el apoyo pol√≠tico, moral, jur√≠dico, econ√≥mico y t√©cnico del Gobierno Revolucionario.', 'Hugo Rafael Ch√°vez Fr√≠as', NULL);
INSERT INTO frases_chavez VALUES (486, 'No podemos olvidar el significado del compromiso cristiano en la historia: la construcci√≥n de un mundo de vida, con justicia y en paz; afirmaci√≥n en el pensar y en el hacer de la opci√≥n preferencial por los pobres que nos ense√±√≥ Jes√∫s.', 'Hugo Rafael Ch√°vez Fr√≠as', NULL);
INSERT INTO frases_chavez VALUES (489, 'Hay un despertar de nuestros pueblos; no nos toca a nosotros sino colocarnos a la altura de ese despertar.', 'Hugo Rafael Ch√°vez Fr√≠as', NULL);
INSERT INTO frases_chavez VALUES (504, 'En Venezuela estamos construyendo la f√≥rmula del hombre en sociedad, la f√≥rmula de la paz, la f√≥rmula de la hermandad, la f√≥rmula del verdadero cristianismo: el hombre en libertad e igualdad.', 'Hugo Rafael Ch√°vez Fr√≠as', NULL);
INSERT INTO frases_chavez VALUES (507, 'La econom√≠a debe estar al servicio de la pol√≠tica: hay que politizar la econom√≠a y tambi√©n hay que socializar la pol√≠tica, ya que √©sta debe colocar por delante los grandes intereses de la sociedad.', 'Hugo Rafael Ch√°vez Fr√≠as', NULL);
INSERT INTO frases_chavez VALUES (509, 'En Venezuela enmascararon la privatizaci√≥n con una llamada ‚Äòapertura petrolera‚Äô nefasta para el inter√©s nacional, que hoy en d√≠a est√° muerta y la estamos enterrando.', 'Hugo Rafael Ch√°vez Fr√≠as', NULL);
INSERT INTO frases_chavez VALUES (513, 'Tiene que ejercerse el poder para beneficio de todos, no para salvaguardar intereses particulares.', 'Hugo Rafael Ch√°vez Fr√≠as', NULL);
INSERT INTO frases_chavez VALUES (514, 'El gobierno administra el Tesoro de la Naci√≥n; as√≠ como durante muchos a√±os los gobiernos lo administraron para favorecer a un sector determinado, ahora nosotros lo administramos con sentido de justicia.', 'Hugo Rafael Ch√°vez Fr√≠as', NULL);
INSERT INTO frases_chavez VALUES (515, '¬°Estamos arando tierra f√©rtil y la siembra revienta por la sementera!, ¬°es la Patria nueva que se levanta!', 'Hugo Rafael Ch√°vez Fr√≠as', NULL);
INSERT INTO frases_chavez VALUES (498, 'Tenemos la necesidad del di√°logo permanente entre la Iglesia Cat√≥lica y el Gobierno de la Rep√∫blica Bolivariana; el di√°logo debe ser nuestra opci√≥n irrenunciable, en la que cada quien mantenga su visi√≥n y su forma de entender y de actuar en la realidad nacional, pero sosteniendo siempre el di√°logo abierto.', 'Hugo Rafael Ch√°vez Fr√≠as', NULL);
INSERT INTO frases_chavez VALUES (519, 'Cada d√≠a la Patria venezolana debe ser m√°s grande, m√°s independiente, m√°s aut√≥noma, m√°s soberana; en la medida que seamos m√°s independientes, tendremos m√°s capacidad para solucionar los grav√≠simos problemas heredados de la miseria, la pobreza y la exclusi√≥n.', 'Hugo Rafael Ch√°vez Fr√≠as', NULL);
INSERT INTO frases_chavez VALUES (349, 'Hemos echado las bases pol√≠ticas de lo nuevo que estamos comenzando a construir en estos siete a√±os; bases ideol√≥gicas, sociales, econ√≥micas, militares, morales. Tengamos presente siempre, en todos √°mbitos del pensamiento y acci√≥n del Gobierno Revolucionario, que s√≥lo hemos echado las bases de lo que estamos comenzando a construir; eso es fundamental para entender lo que ahora est√° ocurriendo.', 'Hugo Rafael Ch√°vez Fr√≠as', NULL);
INSERT INTO frases_chavez VALUES (389, 'No debe haber espacio para bajas pasiones en el coraz√≥n de los revolucionarios.', 'Hugo Rafael Ch√°vez Fr√≠as', NULL);
INSERT INTO frases_chavez VALUES (411, 'En Venezuela est√° en marcha un proyecto nacional que tom√≥ forma constitucional; nuestra Constituci√≥n es mucho m√°s que una ley magna, es el proyecto nacional de pa√≠s hecho Constituci√≥n.', 'Hugo Rafael Ch√°vez Fr√≠as', NULL);
INSERT INTO frases_chavez VALUES (502, '¬°Cristo es, sin duda, el paradigma del verdadero y aut√©ntico revolucionario!: El que es capaz de dar su vida por los dem√°s, y sobre todo por los m√°s d√©biles, los pobres, los que estuvieron excluidos, los que han sufrido la opresi√≥n y la explotaci√≥n de una sociedad injusta.', 'Hugo Rafael Ch√°vez Fr√≠as', NULL);
INSERT INTO frases_chavez VALUES (15, 'El nuestro es un proyecto que se inscribe en la bandera de Sim√≥n Rodr√≠guez, donde la educaci√≥n es un derecho humano fundamental; el nuestro es un proyecto socialista que garantiza educaci√≥n gratuita y de calidad para todos.', 'Hugo Rafael Ch√°vez Fr√≠as', 'img/chavez/015.png');
INSERT INTO frases_chavez VALUES (20, 'Estoy comprometido con mi vida, con mi muerte incluso, por el destino de Venezuela. ¬°Llamo a todos a que arreciemos la marcha en esta gran batalla!', 'Hugo Rafael Ch√°vez Fr√≠as', 'img/chavez/020.png');
INSERT INTO frases_chavez VALUES (21, '¬°Liberamos de verdad a Venezuela o morimos en el intento!', 'Hugo Rafael Ch√°vez Fr√≠as', 'img/chavez/021.png');
INSERT INTO frases_chavez VALUES (23, '¬°Somos todos o no hay Patria, sociedad ni futuro!', 'Hugo Rafael Ch√°vez Fr√≠as', 'img/chavez/023.png');
INSERT INTO frases_chavez VALUES (27, 'La Revoluci√≥n es una pasi√≥n, y la juventud es el elemento maravilloso que le inyecta fuerza a la Revoluci√≥n Bolivariana.', 'Hugo Rafael Ch√°vez Fr√≠as', 'img/chavez/027.png');
INSERT INTO frases_chavez VALUES (29, 'Cada ataque contrarrevolucionario debe ser respondido con el impulso y la profundizaci√≥n de la Revoluci√≥n, las misiones surgieron como parte del ataque revolucionario.', 'Hugo Rafael Ch√°vez Fr√≠as', 'img/chavez/029.png');
INSERT INTO frases_chavez VALUES (31, 'Las revoluciones no se planifican ni se decretan: ¬°se desatan como los volcanes!', 'Hugo Rafael Ch√°vez Fr√≠as', 'img/chavez/031.png');
INSERT INTO frases_chavez VALUES (500, 'La doctrina aut√©ntica de Cristo, que es una doctrina liberadora, es una doctrina revolucionaria, por eso cada d√≠a somos m√°s cristianos y estamos m√°s con Cristo el Redentor de los pueblos.', 'Hugo Rafael Ch√°vez Fr√≠as', 'img/chavez/079.png');
INSERT INTO frases_chavez VALUES (448, 'Invito, desde mi modesto puesto de batalla, a las mujeres venezolanas para que cada d√≠a asuman con mayor fuerza, pasi√≥n y amor, la lucha por la revoluci√≥n socialista, por la Venezuela de nuestros hijos, de nuestros nietos; por la Venezuela futura, la Venezuela bonita.', 'Hugo Rafael Ch√°vez Fr√≠as', 'img/chavez/036.png');
INSERT INTO frases_chavez VALUES (452, 'Quiero rendir tributo a las mujeres africanas que fueron tra√≠das como esclavas, que aqu√≠ parieron a sus hijos y nos regalaron ese bello color, que ligado con el indio americano y el blanco europeo, ha generado la mezcla perfecta: esta civilizaci√≥n m√°gica que somos los latinoamericanos.', 'Hugo Rafael Ch√°vez Fr√≠as', 'img/chavez/060.png');
INSERT INTO frases_chavez VALUES (508, 'Los l√≠deres deben escuchar el clamor de los pueblos.', 'Hugo Rafael Ch√°vez Fr√≠as', 'img/chavez/059.png');
INSERT INTO frases_chavez VALUES (488, 'Me atrevo a decirlo mirando el horizonte de este siglo: ¬°ahora o nunca!, ¬°ha resucitado este pueblo! As√≠ lo sentimos, hay una resurrecci√≥n en Latinoam√©rica, y nosotros no somos sino producto de ese renacimiento.', 'Hugo Rafael Ch√°vez Fr√≠as', 'img/chavez/129.png');
INSERT INTO frases_chavez VALUES (40, 'Estamos dando pasos firmes en la construcci√≥n de un nuevo modelo educativo universitario: una universidad nueva, un nuevo proyecto de educaci√≥n superior.', 'Hugo Rafael Ch√°vez Fr√≠as', 'img/chavez/040.png');
INSERT INTO frases_chavez VALUES (44, 'El primero de todos los poderes, despu√©s del poder de Dios, es el conocimiento.', 'Hugo Rafael Ch√°vez Fr√≠as', 'img/chavez/044.png');
INSERT INTO frases_chavez VALUES (45, 'Los seres humanos somos culpables de muchos desastres en este mundo, pero los seres humanos seguimos siendo la esperanza, ¬°y salvaremos a este mundo con Dios por delante!', 'Hugo Rafael Ch√°vez Fr√≠as', 'img/chavez/045.png');
INSERT INTO frases_chavez VALUES (48, 'Necesitamos una educaci√≥n alejada del individualismo y del ego√≠smo, que siembre nuevos valores humanos y sociales.', 'Hugo Rafael Ch√°vez Fr√≠as', 'img/chavez/048.png');
INSERT INTO frases_chavez VALUES (50, 'La Revoluci√≥n permite construir una Patria verdadera, una Patria plena, donde lo m√°s importante es el hombre.', 'Hugo Rafael Ch√°vez Fr√≠as', 'img/chavez/050.png');
INSERT INTO frases_chavez VALUES (53, 'Cuenten conmigo para siempre, todos los d√≠as y todas las noches, en esta batalla grande y bonita contra la pobreza.', 'Hugo Rafael Ch√°vez Fr√≠as', 'img/chavez/053.png');
INSERT INTO frases_chavez VALUES (57, 'Cada d√≠a el mundo est√° m√°s esperanzado con la Revoluci√≥n Bolivariana.', 'Hugo Rafael Ch√°vez Fr√≠as', 'img/chavez/057.png');
INSERT INTO frases_chavez VALUES (60, 'Si estamos empe√±ados en salvar al planeta, debemos comenzar salvando los bosques, salvando las aguas, salvando a nuestra madre naturaleza.', 'Hugo Rafael Ch√°vez Fr√≠as', 'img/chavez/060.png');
INSERT INTO frases_chavez VALUES (63, 'La democracia revolucionaria tiene que fundamentarse en la organizaci√≥n y la movilizaci√≥n popular.', 'Hugo Rafael Ch√°vez Fr√≠as', 'img/chavez/063.png');
INSERT INTO frases_chavez VALUES (73, 'Capacidad, eficiencia y eficacia, orientadas a la satisfacci√≥n de las necesidades de nuestro pueblo, son los objetivos supremos de nuestra Revoluci√≥n.', 'Hugo Rafael Ch√°vez Fr√≠as', 'img/chavez/073.png');
INSERT INTO frases_chavez VALUES (75, 'Nunca me cansar√© de pedirle a todos que nos quitemos, como quien se quita una telara√±a pegajosa, los viejos vicios de la corrupci√≥n, la burocratizaci√≥n, la ineficiencia, la incapacidad, la falta de planificaci√≥n, la falta de trabajo en equipo. ¬°Todo eso hay que dejarlo atr√°s!', 'Hugo Rafael Ch√°vez Fr√≠as', 'img/chavez/075.png');
INSERT INTO frases_chavez VALUES (78, 'Un presidente revolucionario tiene que andar en las calles junto al pueblo, en los campos con los campesinos. ¬°Un presidente revolucionario no puede encerrarse en un palacio!', 'Hugo Rafael Ch√°vez Fr√≠as', 'img/chavez/078.png');
INSERT INTO frases_chavez VALUES (81, 'Hemos recuperado el manejo del petr√≥leo y de la riqueza petrolera. ¬øPara qu√©? Para distribuirla, para sembrarla, para transformarla.', 'Hugo Rafael Ch√°vez Fr√≠as', 'img/chavez/081.png');
INSERT INTO frases_chavez VALUES (82, 'Respetamos al sector privado, pero el sector privado tiene que subordinarse a los planes estrat√©gicos de la Naci√≥n y de la Revoluci√≥n.', 'Hugo Rafael Ch√°vez Fr√≠as', 'img/chavez/082.png');
INSERT INTO frases_chavez VALUES (88, 'Formemos en nuestros ni√±os un coraz√≥n para lo hermoso, para lo grande, para el sendero de la Patria buena.', 'Hugo Rafael Ch√°vez Fr√≠as', 'img/chavez/088.png');
INSERT INTO frases_chavez VALUES (90, 'Debemos ser capaces de buscar el conocimiento verdadero y apartar los ruidos que tratan de inducirnos a la confusi√≥n. Debemos tener la vista y la mente clara.', 'Hugo Rafael Ch√°vez Fr√≠as', 'img/chavez/090.png');
INSERT INTO frases_chavez VALUES (92, 'Para que nuestra Revoluci√≥n nunca muera, siga avanzando y cada d√≠a est√© m√°s viva en el coraz√≥n y en el alma del pueblo, hacen falta muchas cosas, entre ellas es fundamental: la conciencia, coherencia, y organizaci√≥n del pueblo.', 'Hugo Rafael Ch√°vez Fr√≠as', 'img/chavez/092.png');
INSERT INTO frases_chavez VALUES (94, 'Para que el pueblo se concrete en fuerza real debe tener, primero que nada, conciencia; y para que el pueblo tenga conciencia debe tener conocimiento y cultura.', 'Hugo Rafael Ch√°vez Fr√≠as', 'img/chavez/094.png');
INSERT INTO frases_chavez VALUES (99, 'Tenemos que ayudar todos los d√≠as al nacimiento de la conciencia cuando no la haya, y al fortalecimiento de la conciencia cuando ya exista.', 'Hugo Rafael Ch√°vez Fr√≠as', 'img/chavez/099.png');
INSERT INTO frases_chavez VALUES (110, 'Sembremos con muchas ideas, con mucho pensamiento, sabidur√≠a y ejemplo las semillas, los arbolitos de la Patria futura, de la Patria grande, libre y pr√≥spera.', 'Hugo Rafael Ch√°vez Fr√≠as', 'img/chavez/110.png');
INSERT INTO frases_chavez VALUES (114, '¬°Que salgan los capitalistas a proponer el capitalismo a ver qu√© dicen los pueblos!', 'Hugo Rafael Ch√°vez Fr√≠as', 'img/chavez/114.png');
INSERT INTO frases_chavez VALUES (116, 'La sociedad capitalista se encuentra profundamente enferma de ego√≠smo, ambiciones, individualismo e injusticia generadora de violencia.', 'Hugo Rafael Ch√°vez Fr√≠as', 'img/chavez/116.png');
INSERT INTO frases_chavez VALUES (117, 'El capitalismo es el reino de lo privado, de lo individual. El socialismo es el reino de lo p√∫blico, de lo colectivo.', 'Hugo Rafael Ch√°vez Fr√≠as', 'img/chavez/117.png');
INSERT INTO frases_chavez VALUES (118, 'El socialismo no es el fin, el socialismo es el camino.', 'Hugo Rafael Ch√°vez Fr√≠as', 'img/chavez/118.png');
INSERT INTO frases_chavez VALUES (120, 'El capitalismo es voraz, salvaje y anticristiano; nosotros defendemos el socialismo, que es humanista y cristiano.', 'Hugo Rafael Ch√°vez Fr√≠as', 'img/chavez/120.png');
INSERT INTO frases_chavez VALUES (124, 'Tenemos que dar una lucha, pero en una batalla diaria, contra los antivalores del capitalismo.', 'Hugo Rafael Ch√°vez Fr√≠as', 'img/chavez/124.png');
INSERT INTO frases_chavez VALUES (125, 'El capitalista crece y se forma en un caldo cuyos componentes son la mezquindad y el individualismo, conform√°ndose as√≠ un modelo que destruye la esencia del ser humano.', 'Hugo Rafael Ch√°vez Fr√≠as', 'img/chavez/125.png');
INSERT INTO frases_chavez VALUES (534, 'La independencia es la v√≠a para convertir a Venezuela en un pa√≠s potencia.', 'Recorrido por la Faja Petrol√≠fera del Orinoco. 22 de agosto 2012', NULL);
INSERT INTO frases_chavez VALUES (537, 'Es un proyecto maravilloso... A trav√©s de la educaci√≥n y la cultura surge la liberaci√≥n de la mente y de los pueblos.', 'Instalaci√≥n de la F√°brica de Computadoras Port√°tiles Canaima.
INSERT INTO frases_chavez VALUES (536, 'Impulsar la ciencia‚Ä¶ Quiero motivar a todo el pa√≠s a prepararse en profesiones cient√≠ficas, es buscar la armon√≠a entre todas las Ciencias.', 'Entrega de Computadoras Port√°tiles Canaimitas en las Escuelas Bolivarianas, de la Laguna de Sinamaica en el Estado Zulia.  17 de agosto 2012.', NULL);
INSERT INTO frases_chavez VALUES (538, 'Ustedes se lo merecen, son nuestras ni√±as, nuestros ni√±os y j√≥venes que merecen lo mejor, para que se capaciten al m√°s alto nivel, para hacer de esta Venezuela cada d√≠a m√°s grande y m√°s hermosa.', 'Entrega de Computadoras Port√°tiles Canaimitas en Escuela Nacional Bolivariana Claudio Feliciano II. Parroquia Macarao. Mcpo. Libertador. Dto. Capital. 17 de septiembre de 2012.', NULL);
INSERT INTO frases_chavez VALUES (535, 'S√≥lo un pa√≠s independiente puede ser grande, libre. Ahora hay que apurar el paso para el desarrolloINSERT INTO frases_chavez VALUES (547, 'Se ha ampliado la red de fibra √≥ptica para democratizar el acceso a las telecomunicaciones de la poblaci√≥n venezolana. En el 2007, despu√©s de la nacionalizaci√≥n de la CANTV, hab√≠a 7.737 kil√≥metros de fibra √≥ptica, limitada casi toda a la franja norte costera, ahora hemos avanzado hacia el sur y hacia el centro y el a√±o pasado terminamos en 11.481 kil√≥metros, incluyendo conexi√≥n con Brasil y las zonas del sur. Este a√±o debemos cerrar con cerca de 16.000 kil√≥metros, es decir, en apenas 5 a√±os hemos m√°s que duplicado la conectividad en Venezuela y adem√°s ahora disponible hasta para los pueblos ind√≠genas.', 'Consejo de Ministros Palacio de Miraflores, Dtto. Capital. 22 de marzo de 2012.', NULL);
INSERT INTO frases_chavez VALUES (548, 'Un proyecto de conexi√≥n de televisi√≥n digital en el eje Buenos Aires-Caracas, con una especie de anillo √≥ptico, para impulsar la soberan√≠a entre ambos pueblos, impulsando nuestros propios contenidos. Esto forma parte de la integraci√≥n suramericana.', 'Encuentro Latinoamericano de Telecomunicaciones. Buenos Aires, Argentina. Video Conferencia Caracas-Buenos Aires. 21 de marzo de 2012.', NULL);
INSERT INTO frases_chavez VALUES (542, 'La soberan√≠a tecnol√≥gica se acopla a una pol√≠tica de Estado, todos los esfuerzos deben estar orientados a las necesidades del pueblo... No deben delegarse los proyectos, hay que hacerle el seguimiento y an√°lisis de todo lo planificado‚Ä¶ Con estos proyectos tecnol√≥gicos se toma en cuenta no s√≥lo la m√°quina sino la persona que las maneja. La Feria de Innovadores Populares o Tecn√≥logos permitir√° darle un impulso a los innovadores tecnol√≥gicos.', 'Feria de Innovadores Populares o Tecn√≥logos. Parque Los Caobos, Dtto. Capital, 26 de abril de 2008.', 'img/chavez/090.png');
INSERT INTO frases_chavez VALUES (549, 'Impulsar la aplicaci√≥n de la Televisi√≥n Digital Terrestre en territorio venezolano: Es muy importante este convenio, ya que nos permite independizarnos en lo que a las comunicaciones se refiere y damos un paso al frente ante esas empresas imperialistas que se encargan de tergiversar la informaci√≥n que ocurre en el mundo.', 'Consejo de Ministros Palacio de Miraflores. Caracas, Dtto. Capital, 20 de marzo de 2013.', NULL);
INSERT INTO frases_chavez VALUES (543, 'La creaci√≥n del Estado mayor de ciencia y tecnolog√≠a debe estar insertado en las 3R (revisi√≥n, rectificaci√≥n y reimpulso).... Si no lo engranamos, ideas maravillosas como los proyectos que estamos aprobando este d√≠a, se los podr√≠a llevar el viento.', 'Feria de Innovadores Populares o Tecn√≥logos. Parque Los Caobos, Dtto. Capital, 26 de abril de 2008.', 'img/chavez/090.png');
INSERT INTO frases_chavez VALUES (546, 'Hago un llamado al pueblo y a los cient√≠ficos a profundizar el estudio y el conocimiento para trabajar por encima de ideolog√≠as, sin importar c√≥mo pienses sobre Ch√°vez. Lo que importa es que seas venezolano y sientas la patria en las v√≠sceras.', 'Encuentro de Tecn√≥logos, Empresarios y Cient√≠ficos. Fundaci√≥n de Institutos de Estudios Avanzados (IDEA). Municipio Baruta del Edo. Miranda, 06 de marzo de 2012.', 'img/chavez/028.png');
INSERT INTO frases_chavez VALUES (544, 'La misi√≥n ciencia que hoy nace, tiene un conjunto de vertientes, de l√≠neas estrategicas y una de esas l√≠neas es la popularizaci√≥n de la ciencia, incluso esa capacidad inventiva que ustedes tienen de inventiva popular, impulsarla y multiplicarla. Hoy es un d√≠a hist√≥rico para el pa√≠s, hoy nace la Misi√≥n Ciencia para Venezuela, para los pueblos hermanos de Am√©rica Latina y el Caribe.', 'Programa Al√≥ Presidente N¬∞ 247, 19 de febrero 2005. Ciudad Guayana, Edo. Bol√≠var.', NULL);
INSERT INTO frases_chavez VALUES (541, 'La Revoluci√≥n est√° creando una tecnolog√≠a social, lo que buscamos es la organizaci√≥n para la producci√≥n, para que los proyectos sean viables deben insertarse en un entorno social, que tambi√©n requiere de una metodolog√≠a, es el hecho de c√≥mo hacer las cosas, es el desarrollo de la fuerza productiva.', 'Feria de Innovadores Populares o Tecn√≥logos. Parque Los Caobos, Dtto. Capital, 26 de abril de 2008.', 'img/chavez/028.png');
INSERT INTO frases_chavez VALUES (551, 'Estamos en el momento preciso de dos saltos: uno cualitativo, cambiar los paradigmas de la televisi√≥n en Venezuela y hacer una televisi√≥n para la vida, la paz, el amor, la patria, para los grandes valores, entretenida y de calidad. El segundo salto es el tecnol√≥gico, para que todo el mundo tenga acceso a este servicio por la v√≠a de la televisi√≥n digital.', 'Presidente Nicol√°s Maduro. Lanzamiento del Canal Conciencia TV en per√≠odo de prueba. Plaza de Los Museos, Dtto. Capital, 12 de abril de 2013.', 'img/chavez/m002.png');
INSERT INTO frases_chavez VALUES (553, 'El esfuerzo central: las grandes pol√≠ticas colectivas. La construcci√≥n de un sistema de gobierno popular, que tenga la capacidad para gestionar toda la problem√°tica popular y para dirigir una pol√≠tica transformadora sobre los problemas de manera coherente que nos permitan darle respuesta al pueblo.', 'Presidente Nicol√°s Maduro. Universidad Polit√©cnica Andr√©s Eloy Blanco. Barquisimeto, Edo. Lara, 13 de junio 2013.', 'img/chavez/m003.png');
INSERT INTO frases_chavez VALUES (540, 'La f√°brica de Peque√±os Sat√©lites, permitir√° profundizar la independencia tecnol√≥gica del pa√≠s, para
INSERT INTO frases_chavez VALUES (552, '¬°Venezuela, se ha lanzado el sat√©lite Miranda! Nuestro pa√≠s contin√∫a desplegando su soberan√≠a e independencia en materia tecnol√≥gica. Una mirada soberana sobre nuestro territorio velar√° por nuestro crecimiento como naci√≥n libre.', 'Lanzamiento y puesta en √≥rbita del VRSS-1 Miranda. Palacio de Miraflores, 28 de septiembre de 2012.', 'img/chavez/090.png');
INSERT INTO frases_chavez VALUES (550, 'Estas computadoras tienen un conjunto de informaciones, son un instrumentos tecnol√≥gicos para el estudio y formaci√≥n de los estudiantes adem√°s, les permite estar compenetrados con el mundo de la tecnolog√≠a. Esta es una inversi√≥n que hace la Patria en tecnolog√≠a para la juventud.', 'Presidente Nicol√°s Maduro. Entrega de las primeras computadoras Canaima a estudiantes de secundaria. Gobierno de Calle. Municipio Guanta, Edo. Anzo√°tegui. 23 de mayo 2013.', 'img/chavez/m001.png');
INSERT INTO frases_chavez VALUES (545, 'Al fin estamos comenzando a contar en Venezuela con un sistema de ciencia y tecnolog√≠a, los avances cient√≠ficos y tecnol√≥gicos nacionales, dan el salto y se desarrollan en funci√≥n de lo humano y no para la destrucci√≥n y acumulaci√≥n de capital. Es la ciencia √∫til, necesaria para impulsar el desarrollo integral del pa√≠s, el desarrollo nacional.', 'Encuentro de Tecn√≥logos, Empresarios y Cient√≠ficos. Fundaci√≥n de Institutos de Estudios Avanzados (IDEA). Municipio Baruta del Edo. Miranda, 06 de marzo de 2012.', 'img/chavez/115.png');
INSERT INTO frases_chavez VALUES (554, 'La corrupci√≥n es una enfermedad que afecta la salud p√∫blica y quebranta el √≥rgano de la Rep√∫blica, si la corrupci√≥n contin√∫a perpetu√°ndose en las bases del capitalismo aqu√≠ no podr√° afianzarse el socialismo, llamo al pueblo a no tolerar la corrupci√≥n ni de cuello amarillo ni de cuello rojo, la haga quien la haga, es la misma conducta ap√°trida y antipopular, v√≠stase como se vista, hemos pasado a la ofensiva en esta batalla y no la abandonaremos.', 'Presidente Nicol√°s Maduro. Solicitud ante la Asamblea Nacional de la Ley Habilitante contra la corrupci√≥n. Palacio Legislativo, 8 de 0ctubre 2013.', 'img/chavez/m004.png');
INSERT INTO frases_chavez VALUES (555, 'Una pol√≠tica de estado tiene que ser para resolver las necesidades colectivas en lo fundamental y tener capacidad para atender al ciudadano en su necesidad individual tambi√©n, es complementario, pero el esfuerzo central m√≠o como Presidente y del Gobierno, de nosotros, es las grandes pol√≠tica colectivas.', 'Presidente Nicol√°s Maduro. Universidad Polit√©cnica Andr√©s Eloy Blanco. Barquisimeto, Edo. Lara, 13 de junio 2013.', 'img/chavez/m005.png');
INSERT INTO frases_chavez VALUES (556, '¬°La batalla por la independencia y la prosperidad nacional la debemos ganar todos los d√≠as, con fe en nuestra Patria y esp√≠ritu de victoria!', 'Presidente Nicol√°s Maduro. Fuente: MINCI 24 de Septiembre de 2013 Palacio de Miraflores. Caracas', 'img/chavez/m006.png');
INSERT INTO frases_chavez VALUES (557, 'Sigue en las calles nuestro Comandante, sigue en nuestros corazones. All√≠ donde hay un compatriota haciendo Patria, ah√≠ est√° Ch√°vez protegiendo al humilde, al pobre, al trabajador a la clase media', 'Presidente Nicol√°s Maduro. Fuente: Diario Ciudad Caracas. Lanzamiento de la Misi√≥n Barrio Nuevo Barrio Tricolor Edo. Aragua', 'img/chavez/m007.png');
INSERT INTO frases_chavez VALUES (564, 'Aqu√≠ nos dej√≥ nuestro Comandante Ch√°vez con una tarea, con una misi√≥n, y aqu√≠ la llevamos: consolidar a Venezuela, su democracia y seguir consolidando nuestra Suram√©rica.', 'Nicol√°s Maduro. Fuente: SIBCI 12-11-2012', 'img/chavez/m014.png');
INSERT INTO frases_chavez VALUES (558, 'El pueblo debe ser protagonista de las bases econ√≥micas del socialismo bolivariano y las comunas, el mas poderoso instrumento para construir el Plan de la Patria de manera integral, de abajo hacia arriba.', 'Nicol√°s Maduro. Fuente: SIBCI 16-11-2013. Palacio de Miraflores en el marco del I Encuentro de Comuneros', 'img/chavez/m008.png');
INSERT INTO frases_chavez VALUES (559, 'El Gobierno Bolivariano trabaja en la Revoluci√≥n Democr√°tica Comunal del Socialismo venezolano.', 'Nicol√°s Maduro. Fuente: SIBCI. Jornada del Censo Comunal, 7  de septiembre de 2013', 'img/chavez/m009.png');
INSERT INTO frases_chavez VALUES (560, 'Pido Uni√≥n a todo el pa√≠s para seguir consolidando la ofensiva econ√≥mica y proteger al pueblo de los capitalistas usureros que lo roban.', 'Fuente: @NicolasMaduro. 19-11-2013. En el marco de la aprobaci√≥n de la Ley Habilitante en la Asamblea Nacional.', 'img/chavez/m010.png');
INSERT INTO frases_chavez VALUES (561, 'Construyamos una econom√≠a con base productiva, una poderosa econom√≠a o no habr√° socialismo.', 'Nicol√°s Maduro. Fuente: SIBCI 16-11-2013. Palacio de Miraflores. I Encuentro de Comuneros', 'img/chavez/m011.png');
INSERT INTO frases_chavez VALUES (562, 'Estamos construyendo una poderosa Fuerza Armada Nacional Bolivariana, disciplinda, subordinada profundamente a la Constituci√≥n y al pueblo.', 'Nicol√°s Maduro. Fuente. Diario √öltimas Noticias, 13-11-2013. Centro de Adiestramiento y Combate Jos√© Laurencio Silva en El Pao, Edo. Cojedes', 'img/chavez/m012.png');
INSERT INTO frases_chavez VALUES (563, 'Hemos trabajado para consolidar una zona econ√≥mica de desarrollo compartido con el Alianza Bolivariana para los Pueblos de Nuestra Am√©rica (Alba), con Petrocaribe, agruparnos para actividades econ√≥micas, inversiones conjuntas, para el desarrollo comercial, y muchos otros proyectos.', 'Nicol√°s Maduro. Fuente: SIBCI 12-11-2012', 'img/chavez/m013.png');
INSERT INTO frases_chavez VALUES (570, 'El llamado que hago es a la paz del pa√≠s, nosotros estamos para trabajar. Al pueblo alerta para vigilar la paz, para preservar la paz.', 'Nicol√°s Madruo. Fuente: SIBCI 25 de Abril de 2013. Parroquia el Valle, Caracas.', 'img/chavez/m020.png');
INSERT INTO frases_chavez VALUES (566, 'Tengan la seguridad de que hagan lo que hagan los enemigos de la patria aqu√≠ habr√° paz, paz y m√°s paz para la familia de Venezuela. Tranquilidad, trabajo, vida y prosperidad. No podr√°n perturbar m√°s nunca la paz y la vida de este pa√≠s.', 'Nicol√°s Maduro. Fuente Sibci. 19-11-2013. Aprobaci√≥n Ley Habilitante', 'img/chavez/m016.png');
INSERT INTO frases_chavez VALUES (567, 'Visitar√© el estado para arrancar las giras del Gobierno de calle, voy con todo nuestro equipo a trabajar por el Zulia y Venezuela.', '@NicolasMaduro. En el marco de segundo gobierno de calle. 19 de Octubre de 2013', 'img/chavez/m017.png');
INSERT INTO frases_chavez VALUES (568, 'Hoy viernes, 1¬∞ de Noviembre, quisimos decretar la llegada de la navidad porque queremos la felicidad para todo el pueblo, la paz y la felicidad para todos, la navidad temprana es la mejor vacuna para cualquiera que puedan inventar.', 'Nicol√°s Maduro. Fuente: SIBCI 01 de Noviembre 2013. Parque Los Caobos, en la ciudad de Caracas.', 'img/chavez/m018.png');
INSERT INTO frases_chavez VALUES (569, 'Decir Bol√≠var en el siglo XXI es decir Ch√°vez, no se podr√° entender a Bol√≠var sin pasar por Ch√°vez, al final fueron el mismo esp√≠ritu, la misma idea, proyecto y el mismo pueblo en circunstancias distintas.', 'Nicol√°s Maduro. Fuente: SIBCI 6 de Noviembre 2013', 'img/chavez/m019.png');
INSERT INTO frases_chavez VALUES (571, 'La espada de Bol√≠var es la del pueblo en batalla permanente.', 'Nicol√°s Maduro. Fuente: rnv.gob.ve  07 de Octubre de 2013, Caracas', 'img/chavez/m021.png');
INSERT INTO frases_chavez VALUES (572, 'Hemos logrado algo que jam√°s, ni nunca cre√≠a nadie que pod√≠amos lograr: hemos bajado los precios de los productos, primera vez en el pa√≠s (‚Ä¶) Abajo los precios, abajo los especuladores, abajo la conspiraci√≥n, ¬°arriba el pueblo de Venezuela! ¬°arriba la Revoluci√≥n de Bol√≠var!, ¬°arriba la patria!', 'Nicol√° Maduro. Fuente: Diario Ciudad Caracas, 18-11-2013', 'img/chavez/m022.png');
INSERT INTO frases_chavez VALUES (573, 'Abajo los precios. Abajo la especulaci√≥n‚Ä¶ Abajo la corrupci√≥n y el ladronaje. Arriba el pueblo‚Ä¶ Arriba la Revoluci√≥n Bolivariana.', 'Nicol√°s Maduro. Fuente: vtv.gob.ve Caracas, 17 de noviembre de 2013', 'img/chavez/m023.png');
INSERT INTO frases_chavez VALUES (574, 'Consolidar las comunas es un objetivo fundacional del chavismo: Sin comunas no habr√° Patria nueva, sin comunas se acabar√≠a todo. La comuna es el epicentro para la vida verdaderamente humana, en socialismo.', 'Nicol√°s Maduro. Fuente: SIBCI Caracas 16 de Noviembre de 2013', 'img/chavez/m024.png');
INSERT INTO frases_chavez VALUES (575, 'Tenemos un plan, tenemos un proyecto... Este pueblo no despert√≥ con Ch√°vez para volver a las tinieblas y andar de rodillas otra vez, frente a las √©lites enriquecidas que han saqueado a este pa√≠s, convoco a toda Venezuela a que sumemos en esta batalla contra la derecha del pa√≠s.', 'Presidente Nicol√°s Maduro decreta acciones para derrotar guerra econ√≥mica. Fuente: TELESUR 6 de Noviembre de 2013', 'img/chavez/m025.png');
INSERT INTO frases_chavez VALUES (565, '‚Ä¶ Ofensiva econ√≥mica en contra de la usura y la especulaci√≥n‚Ä¶ Vamos a consolidar los precios justos contra la usura capitalista.', 'Nicol√°s Maduro. Fuente: Diario √öltimas Noticias. 21-11-2013. Aprobaci√≥n Ley Habilitante', 'img/chavez/m015.png');
INSERT INTO frases_chavez VALUES (286, 'Hemos dejado de ser una colonia petrolera, comenzamos a cumplir el deseo del eminente venezolano Arturo Uslar Pietri: Hay que sembrar el petr√≥leo.', 'Hugo Rafael Ch√°vez Fr√≠as', 'img/chavez/022.png');
INSERT INTO frases_chavez VALUES (414, 'Queremos que el gobierno imperialista termine de aceptar la realidad: ¬°Venezuela se liber√≥, y se liber√≥ para siempre! ¬°Venezuela no es, ni ser√° m√°s nunca, una colonia norteamericana!', 'Hugo Rafael Ch√°vez Fr√≠as', 'img/chavez/079.png');
INSERT INTO frases_chavez VALUES (415, '¬°Venezuela no es, ni ser√° m√°s nunca, una colonia norteamericana!', 'Hugo Rafael Ch√°vez Fr√≠as', 'img/chavez/048.png');
INSERT INTO frases_chavez VALUES (259, 'Invocamos a nuestros libertadores, invocamos a Dios Todopoderoso, a Cristo Redentor, para que nos permita continuar avanzando por esta vereda que cada d√≠a ser√° m√°s ancha, m√°s pr√≥spera y m√°s libre.', 'Hugo Rafael Ch√°vez Fr√≠as', 'img/chavez/062.png');
INSERT INTO frases_chavez VALUES (386, 'El neoliberalismo es como cuando el c√°ncer entra en met√°stasis: el capitalismo en su fase neoliberal mata a la vida social, la acaba, la descuaja, la tritura.', 'Hugo Rafael Ch√°vez Fr√≠as', 'img/chavez/011.png');
INSERT INTO frases_chavez VALUES (447, 'En el marco del sistema capitalista es imposible derrotar la exclusi√≥n y el atropello a la mujer, porque el sistema capitalista tiene su base en los antivalores de la exclusi√≥n, el machismo, la violencia, la degradaci√≥n de los valores humanos, y particularmente de la mujer.', 'Hugo Rafael Ch√°vez Fr√≠as', 'img/chavez/138.png');
INSERT INTO frases_chavez VALUES (455, 'Hoy, cuando comienza el siglo XXI, cu√°n importante es ‚Äîmucho m√°s que ayer‚Äî el avance de los movimientos de mujeres en el mundo, para romper definitivamente las cadenas de opresi√≥n y dominaci√≥n.', 'Hugo Rafael Ch√°vez Fr√≠as', 'img/chavez/035.png');
INSERT INTO frases_chavez VALUES (295, 'Es fundamental para el proyecto nacional la ciencia y la tecnolog√≠a. Hay que aplicar la ciencia y la tecnolog√≠a en todas las cosas, por m√°s sencillas que sean.', 'Hugo Rafael Ch√°vez Fr√≠as', 'img/chavez/115.png');
INSERT INTO frases_chavez VALUES (539, 'Un salto tecnol√≥gico, ¬°Es el futuro!... Esto es parte del desarrollo cient√≠fico y tecnol√≥gico de la naci√≥n en funci√≥n de nuestras necesidades.', 'Lanzamiento del Sat√©lite Francisco de Miranda desde China. 28 de septiembre 2012.', 'img/chavez/090.png');
