INSERT INTO plan_patria_oe VALUES (1, 'DEFENDER, EXPANDIR Y CONSOLIDAR EL BIEN M√ÅS PRECIADO QUE HEMOS RECONQUISTADO DESPU√âS DE 200 A√ëOS: LA INDEPENDENCIA NACIONAL', 'I.');
INSERT INTO plan_patria_oe VALUES (2, 'CONTINUAR CONSTRUYENDO EL SOCIALISMO BOLIVARIANO DEL SIGLO XXI, EN VENEZUELA, COMO ALTERNATIVA AL SISTEMA DESTRUCTIVO Y SALVAJE DEL CAPITALISMO, Y CON ELLO ASEGURAR LA ¬´MAYOR SUMA DE SEGURIDAD SOCIAL, MAYOR SUMA DE ESTABILIDAD POLITICA Y LA MAYOR SUMA DE FELICIDAD, PARA NUESTRO PUEBLO', 'II.');
INSERT INTO plan_patria_oe VALUES (3, 'CONVERTIR A VENEZUELA EN UN PA√çS POTENCIA EN LO SOCIAL, LO ECON√ìMICO Y LO POL√çTICO DENTRO DE LA GRAN POTENCIA NACIENTE DE AM√âRICA LATINA Y EL CARIBE, QUE GARANTICEN LA CONFORMACI√ìN DE UNA ZONA DE PAZ EN NUESTRA AM√âRICA', 'III.');
INSERT INTO plan_patria_oe VALUES (4, 'CONTRBUIR AL DESARROLLO DE UNA NUEVA GEOPOL√çTICA INTERNACIONAL EN LA CUAL TOME CUERPO MUNDO MULTICENTRICO Y PLURIPOLAR QUE PERMITA LOGRAR EL EQUILIBRIO DEL UNIVERSO Y GARANTIZAR LA PAZ PLANETARIA', 'IV.');
INSERT INTO plan_patria_oe VALUES (5, 'CONTRIBUIR CON LA PRESERVACI√ìN DE LA VIDA EN EL PLANETA Y LA SALVACI√ìN DE LA ESPECIE HUMANA', 'V.');
INSERT INTO plan_patria_on VALUES (19, 5, 'Construir e impulsar el modelo econ√≥mico productivo eco-socialista, basado en una relaci√≥n arm√≥nica entre el hombre y la naturaleza, que garantice el uso y aprovechamiento racional, √≥ptimo y sostenible de los recursos naturales, respetando los procesos y ciclos de la naturaleza', '5.1.');
INSERT INTO plan_patria_on VALUES (1, 1, 'Garantizar la continuidad y consolidaci√≥n de la Revoluci√≥n Bolivariana en el poder', '1.1.');
INSERT INTO plan_patria_on VALUES (2, 1, 'Preservar y consolidar la soberan√≠a sobre los recursos petroleros y dem√°s recursos naturales estrat√©gicos', '1.2.');
INSERT INTO plan_patria_on VALUES (3, 1, 'Garantizar el manejo soberano del ingreso nacional', '1.3.');
INSERT INTO plan_patria_on VALUES (4, 1, 'Lograr la soberan√≠a alimentaria para garantizar el sagrado derecho a la alimentaci√≥n de nuestro pueblo', '1.4.');
INSERT INTO plan_patria_on VALUES (7, 2, 'Propulsar la transformaci√≥n del sistema econ√≥mico, en funci√≥n de la transici√≥n al socialismo bolivariano, trascendiendo el modelo rentista petrolero capitalista hacia el modelo econ√≥mico productivo socialista, basado en el desarrollo de las fuerzas productivas', '2.1.');
INSERT INTO plan_patria_on VALUES (6, 1, 'Fortalecer el poder defensivo nacional para proteger la Independencia y la soberan√≠a nacional, asegurando los recursos y riquezas de nuestro pa√≠s para las futuras generaciones', '1.6.');
INSERT INTO plan_patria_on VALUES (8, 2, 'Construir una sociedad igualitaria y justa', '2.2.');
INSERT INTO plan_patria_on VALUES (9, 2, 'Consolidar y expandir el poder popular y la democracia socialista', '2.3.');
INSERT INTO plan_patria_on VALUES (10, 2, 'Convocar y promover una nueva orientaci√≥n √©tica, moral y espiritual de la sociedad, basada en los valores liberadores del socialismo', '2.4.');
INSERT INTO plan_patria_on VALUES (11, 2, 'Lograr la irrupci√≥n definitiva del Nuevo Estado Social y Democr√°tico, de Derecho y de Justicia', '2.5.');
INSERT INTO plan_patria_on VALUES (14, 3, 'Profundizar el desarrollo de la nueva geopol√≠tica nacional y regional, latinoamericana y caribe√±a', '3.3.');
INSERT INTO plan_patria_on VALUES (12, 3, 'Consolidar el papel de Venezuela como Potencia Energ√©tica Mundial', '3.1.');
INSERT INTO plan_patria_on VALUES (13, 3, 'Desarrollar el poder√≠o econ√≥mico de la Naci√≥n en base al aprovechamiento √≥ptimo de las potencialidades que ofrecen nuestros recursos para la generaci√≥n de la m√°xima felicidad de nuestro pueblo, as√≠ como de las bases materiales para la construcci√≥n de nuestro socialismo bolivariano', '3.2.');
INSERT INTO plan_patria_on VALUES (15, 4, 'Continuar desempe√±ando un papel protag√≥nico en la construcci√≥n de la uni√≥n latinoamericana y caribe√±a', '4.1.');
INSERT INTO plan_patria_on VALUES (17, 4, 'Continuar impulsando el desarrollo de un Mundo pluripolar sin dominaci√≥n imperial y con respeto a la autodeterminaci√≥n de los pueblos', '4.3.');
INSERT INTO plan_patria_on VALUES (21, 5, 'Defender y proteger el patrimonio hist√≥rico y cultural venezolano y nuestroamericano', '5.3.');
INSERT INTO plan_patria_on VALUES (22, 5, 'Contribuir a la conformaci√≥n de un gran movimiento mundial para contener las causas y reparar los efectos del cambio clim√°tico que ocurren como consecuencia del modelo capitalista depredador', '5.4.');
INSERT INTO plan_patria_on VALUES (18, 4, 'Contribuir con el desmontaje del antihist√≥rico y nefasto sistema imperial y neocolonial', '4.4.');
INSERT INTO plan_patria_on VALUES (20, 5, 'Proteger y defender la soberan√≠a permanente del Estado sobre los recursos naturales para el beneficio supremo de nuestro Pueblo, que ser√° su principal garante', '5.2.');
INSERT INTO plan_patria_on VALUES (5, 1, 'Desarrollar nuestras capacidades cient√≠fico-tecnol√≥gicas vinculadas a las necesidades del pueblo', '1.5.');
INSERT INTO plan_patria_on VALUES (16, 4, 'Afianzar la Identidad Nacional y Nuestroamericana', '4.2.');
